Collection.create([
  { :name => "beaumont", :title => "Beaumont", :created_at => "2013-08-05 05:28:00", :updated_at => "2014-01-28 00:13:36", :description => "<p>Fine craftsmanship and elegant design radiate warmth and reliability. Featuring maple veneers, antique style drawer pulls and a port finish, the Beaumont collection offers classic Louis Philippe style details and superb craftsmanship.</p>\r\n", :link => "", :parent_id => 0 },
  { :name => "bradley", :title => "Bradley", :created_at => "2013-08-05 05:28:38", :updated_at => "2014-01-28 17:34:01", :description => "<p>Inspired by the kathy ireland Home&trade; Americana Style Guide&trade;, Bradley is the point where classic design meets modern convenience. This transitional home entertainment collection features hardwood solids with cherry veneers and satin nickel hardware.</p>\r\n", :link => "", :parent_id => 0 },
  { :name => "bradley-unbranded", :title => "Bradley - Unbranded", :created_at => "2014-01-24 17:30:36", :updated_at => "2014-01-24 17:30:36", :description => "", :link => "", :parent_id => 2 },
  { :name => "california-bungalow", :title => "California Bungalow", :created_at => "2013-08-05 05:29:06", :updated_at => "2013-10-30 20:42:08", :description => "<p>Inspired by the kathy ireland Home&trade; Americana Style Guide&trade; and the early 20th century Arts and Crafts movement, California Bungalow office furniture utilizes sharp lines and iron hardware to produce a simple and functional design. California Bungalow features a classic brown mission finish and is hand-rubbed with lacquer to enhance the richness of natural wood grain.</p>\r\n", :link => "", :parent_id => 0 },
  { :name => "carlton", :title => "Carlton", :created_at => "2013-08-05 05:30:56", :updated_at => "2013-10-30 20:42:41", :description => "<p>Inspired by the kathy ireland Home&trade; Architectural Style Guide&trade;, Carlton boasts modern architectural flare with clean lines and a clear bourbon finish. Complementing any d&eacute;cor, Carlton is a perfect addition to any home.</p>\r\n", :link => "", :parent_id => 0 },
  { :name => "concord", :title => "Concord", :created_at => "2013-08-05 05:31:28", :updated_at => "2013-10-30 20:43:27", :description => "<p>Inspired by the kathy ireland Home&trade; Architectural Style Guide&trade;, The stately design of the Concord collection brings a lasting look of sophistication and function to any office environment. Concord features picture frame detailing, satin nickel hardware and a chestnut finish.</p>\r\n", :link => "", :parent_id => 0 },
  { :name => "contemporary", :title => "Contemporary", :created_at => "2013-08-05 05:31:55", :updated_at => "2013-10-30 20:44:11", :description => "<p>An original Martin Home Furnishings collection, Contemporary is a simple and functional collection. Each piece is finished with multiple-step hand rubbed lacquer, and the case pieces have well-defined bull-nose solid red oak moldings and drawer fronts. The genuine plane slice red oak veneers carefully layered over engineered wood core, combined with ball bearing glides ensure that this collection will stand the test of time.</p>\r\n", :link => "", :parent_id => 0 },
  { :name => "crescent", :title => "Crescent", :created_at => "2013-08-05 05:32:26", :updated_at => "2013-10-30 20:45:18", :description => "<p>Inspired by the kathy ireland Home&trade; Architectural Style Guide&trade;, Crescent&#39;s graceful structural design will bring charm to any living room. Gentle scoops and contemporary nickel hardware grace sliding door fronts. Expertly crafted of poplar solids and maple veneers, Crescent is available in a bright white, onyx black or cognac finishes.</p>\r\n", :link => "", :parent_id => 0 },
  { :name => "empire", :title => "Empire", :created_at => "2013-08-05 05:33:29", :updated_at => "2013-10-30 20:45:45", :description => "<p>Inspired by the kathy ireland Home&trade; Architectural Style Guide&trade;, Empire encompasses simplicity and minimalism. Curved picture frame molding, diamond shaped satin nickel hardware, and a deep java finish create a distinctive transitional look.</p>\r\n", :link => "", :parent_id => 0 },
  { :name => "fremont", :title => "Fremont", :created_at => "2013-08-05 05:35:24", :updated_at => "2013-10-30 20:46:14", :description => "<p>Expertly crafted of select hardwoods and birch veneers, Fremont has a warm chestnut finish and brushed nickel hardware. This transitional group features half-round molding accents and clean architectural lines. The television consoles have a modern breakfront design and offer ample storage space for all of your electronics and accessories.</p>\r\n", :link => "", :parent_id => 0 },
  { :name => "fulton", :title => "Fulton", :created_at => "2013-08-05 05:36:19", :updated_at => "2013-10-30 20:48:15", :description => "<p>Inspired by the kathy ireland Home&trade; Architectural Style Guide&trade;, Fulton is a soft modern collection that blends traditional design elements like crown molding and picture frame detailing with contemporary influences like clean lines, satin nickel hardware and a rich espresso finish. Bring the best of both design worlds in to your home with the Fulton home office collection, a true design solution for living.</p>\r\n", :link => "", :parent_id => 0 },
  { :name => "gravity", :title => "Gravity", :created_at => "2013-08-05 05:37:31", :updated_at => "2013-10-30 20:48:54", :description => "<p>Black glass and caramel stained ash veneers blend modern design and timeless sophistication. Gravity boasts sturdy construction and strikingly handsome design. The asymmetric console offers ample media storage behind modern sliding glass doors.</p>\r\n", :link => "", :parent_id => 0 },
  { :name => "hudson-street", :title => "Hudson Street", :created_at => "2013-08-05 05:37:49", :updated_at => "2013-10-30 20:49:24", :description => "<p>Inspired by the kathy ireland Home&trade; Architectural Style Guide&trade;, Hudson Street is a contemporary collection with clean lines and a classic onyx black finish complemented by brushed nickel hardware. The simplicity of this entertainment furniture collection makes it an easy and comfortable addition to the home. Constructed with hardwood solids and veneers, this collection is built to stand the test of time.</p>\r\n", :link => "", :parent_id => 0 },
  { :name => "huntington", :title => "Huntington", :created_at => "2013-08-05 05:38:24", :updated_at => "2013-10-30 20:50:23", :description => "<p>Inspired by the kathy ireland Home&trade; Americana Style Guide&trade;, Huntington is a transitional furniture design with crafted of &nbsp;hardwood solids and veneers. Vertical fluting, dentil molding and light distressing add character and aesthetic appeal. Huntington Club is a great addition to any home and will surely last for generations to come. Huntington is available in vibrant cherry, wheat or burnish finishes.</p>\r\n", :link => "", :parent_id => 0 },
  { :name => "infinity", :title => "iNfinity", :created_at => "2013-08-05 05:38:54", :updated_at => "2013-10-30 20:51:08", :description => "<p>Inspired by the kathy ireland Home&trade; Architectural Style Guide&trade;, iNfinity is well-suited for today&#39;s small home office. Its sleek modern design and sturdy construction will make it a centerpiece of any home. Equipped with wire management or a power center, the technology friendly desks make organizing and connecting electronics a breeze. The contemporary design features tapered legs and a two&ndash;tone finish. Choose between the bright white or onyx black coupled with a rich bourbon finish and accented by satin nickel hardware.</p>\r\n", :link => "", :parent_id => 0 },
  { :name => "kensington", :title => "Kensington", :created_at => "2013-08-05 05:39:25", :updated_at => "2013-10-30 20:51:52", :description => "<p>Inspired by &nbsp;the kathy ireland Home&trade; Architectural Style Guide&trade; and Biedermeier style, the Kensington collection is comfortably contemporary, showcasing a warm fruitwood finish and contrasting black cove and black bead molding. The tops have reversed diamond matched veneers with a black inlaid border. The posts of the cases are quarter-round and the drawers are accented by half-round molding and ash colored drawer pulls. Kensington is crisp and contemporary without seeming out of place in traditional settings because of the warm finish and understated design elements.</p>\r\n", :link => "", :parent_id => 0 },
  { :name => "kyoto", :title => "Kyoto", :created_at => "2013-08-05 05:39:45", :updated_at => "2013-10-30 20:52:29", :description => "<p>The Kyoto collection features an Asian design influence reminiscent of temple architecture. &nbsp;Flared legs and stylish metal nail heads were inspired by oriental temple architecture and the simplicity of the Arts and Crafts movement.</p>\r\n", :link => "", :parent_id => 0 },
  { :name => "marbella", :title => "Marbella", :created_at => "2013-08-05 05:40:29", :updated_at => "2013-10-30 20:53:08", :description => "<p>Inspired by &nbsp;the kathy ireland Home&trade; Architectural Style Guide&trade; , Marbella showcases Serpentine curves that glide across the rectilinear form of this alluring collection. Marbella&#39;s simple yet sophisticated design features a russet finish complemented by matte black hardware.</p>\r\n", :link => "", :parent_id => 0 },
  { :name => "mission-pasadena", :title => "Mission Pasadena", :created_at => "2013-08-05 05:41:03", :updated_at => "2013-10-30 20:53:41", :description => "<p>Inspired by the kathy ireland Home&trade; Americana Style Guide&trade;, Mission Pasadena combines turn-of-the-century mission design with rustic simplicity. The glow of natural wood complemented by the mission-inspired finish and decorative structures make this collection a comfortable addition to any home.</p>\r\n", :link => "", :parent_id => 0 },
  { :name => "mount-view", :title => "Mount View", :created_at => "2013-08-05 05:41:40", :updated_at => "2013-10-30 20:54:14", :description => "<p>Inspired by the kathy ireland Home&trade; Americana Style Guide&trade;, Mount View offers contemporary conveniences with traditional design elements for today&#39;s home and executive office. Holding true to traditional American beauty, this furniture collection boasts richly grained hardwood with cherry veneers and book matched panels. Incredible durability, style and adaptable configurations combine to form a timeless collection.</p>\r\n", :link => "", :parent_id => 0 },
  { :name => "point-reyes", :title => "Point Reyes", :created_at => "2013-08-05 05:42:08", :updated_at => "2013-10-30 20:54:50", :description => "<p>The multidimensional toasted pecan finish of Point Reyes is accented by solid cast metal hardware and decorative metal corner appliqu&eacute;s. This handsome collection is marked by bold hardware and a warm highlighted finish. Point Reyes is a perfect blend of simplicity and functionality.</p>\r\n", :link => "", :parent_id => 0 },
  { :name => "portland-loft", :title => "Portland Loft", :created_at => "2013-08-05 05:42:35", :updated_at => "2013-10-30 20:55:47", :description => "<p>Inspired by the kathy ireland Home&trade; Americana Style Guide&trade;, Portland Loft is crafted with Elm hardwood solids, antique brass hardware and boasts a vibrant clove finish. Portland Loft combines functionality and style.</p>\r\n", :link => "", :parent_id => 0 },
  { :name => "san-ramon", :title => "San Ramon", :created_at => "2013-08-05 05:43:01", :updated_at => "2013-10-30 20:56:27", :description => "<p>The San Ramon collection offers sleek contemporary design with functional features. &nbsp;Crafted of acacia hardwood and veneers, it showcases a golden auburn finish that pairs seamlessly with matching wicker baskets. Large open shelves accommodate electronics or display items, while the optional wicker baskets organize and conceal your remote controls, DVDs or other entertainment accessories.</p>\r\n", :link => "", :parent_id => 0 },
  { :name => "southampton", :title => "Southampton", :created_at => "2013-08-05 05:43:27", :updated_at => "2013-10-30 20:57:11", :description => "<p>Inspired by the kathy ireland Home&trade; Americana Style Guide&trade;, Southampton is a charming and comfortable home office collection. Southampton is constructed with hardwood solids, and embodies the warmth of a sun filled cottage with a slightly distressed, painted finish and light maple tops on white or oak tops on black. Most pieces are available in both onyx black and oyster white finishes.</p>\r\n", :link => "", :parent_id => 0 },
  { :name => "tribeca-loft", :title => "Tribeca Loft", :created_at => "2013-08-05 05:43:55", :updated_at => "2013-10-30 20:58:18", :description => "<p>Inspired by &nbsp;the kathy ireland Home&trade; Architectural Style Guide&trade; , Tribeca Loft is a lifestyle design consistent with urban furniture trends. &nbsp;The functional features of Tribeca Loft combined with its soft modern style make this collection a true design solution for living. &nbsp;Tribeca loft is available in eggshell white, burnt umber cherry or midnight smoke black with hand-rubbed edges. &nbsp;Pewter colored hardware completes Tribeca Loft&rsquo;s timeless impression.</p>\r\n", :link => "", :parent_id => 0 },
  { :name => "waterfall", :title => "Waterfall", :created_at => "2013-08-05 05:44:24", :updated_at => "2013-10-30 20:58:56", :description => "<p>Waterfall is a timeless Martin Home Furnishings office furniture collection that is crafted with solids and oak veneers. Finger-pull handles on drawers and cupboards are just a few of the details featured in this collection. The multiple-step hand rubbed lacquer finish, well-defined bull-nose solid oak moldings and drawer fronts make Waterfall an excellent investment.</p>\r\n", :link => "", :parent_id => 0 },
  { :name => "worx", :title => "WorX", :created_at => "2013-08-05 05:44:44", :updated_at => "2013-10-30 20:59:41", :description => "<p>Inspired by the kathy ireland Home&trade; Architectural Style Guide&trade;, WorX exudes strength and balance with its linear foundation. This soft modern collection meets today&#39;s home office needs with thoughtful technology integration; wire management holes, electronics charging shelf and a flip down keyboard drawer. Stylish and practical, WorX is available in an Onyx Black finish.</p>\r\n", :link => "", :parent_id => 0 }
], :without_protection => true )



