  { :name => "resources", :title => "Resources", :created_at => "2013-08-05 18:33:14", :updated_at => "2013-12-27 17:52:30", :content => "", :parent_id => 0, :skin_id => 4, :link => "/sections/4", :active => true },
  { :name => "entertainment-solutions", :title => "Entertainment Solutions", :created_at => "2013-08-05 18:33:34", :updated_at => "2013-10-17 19:17:42", :content => "", :parent_id => 1, :skin_id => 4, :link => "/sections/4", :active => true },
  { :name => "easy-wire-access-system-ewas", :title => "Easy Wire Access System™ (EWAS)", :created_at => "2013-08-05 18:34:14", :updated_at => "2013-10-17 22:44:29", :content => "<!--\r\n              =============================================================================\r\n              START TEMPLATE CODE\r\n              =============================================================================\r\n              -->\r\n<div class=\"section-container\">\r\n<div class=\"framed\">\r\n<p>Our patent-pending Easy Wire Access System&trade; (EWAS) is an exclusive development that revolutionizes home entertainment furniture by making do-it-yourself installation of home theater systems truly feasible.</p>\r\n\r\n<p>EWAS includes a soft-close hinged door on the top of the console that provides access to cables, wiring and the back of electronic components.</p>\r\n\r\n<p>With this system there is no need to move the console or the flat-panel television to install home theater components.</p>\r\n\r\n<p>TV consoles with EWAS also include media storage drawers, convection ventilation and an open storage compartment for speakers, gaming consoles or additional components.</p>\r\n\r\n<p>Watch the video below to learn more about EWAS. Then <a href=\"/searches?utf8=%E2%9C%93&amp;product_search=easy+wire+access+system\">see which consoles feature our Easy Wire Access System&trade;</a>.</p>\r\n</div>\r\n\r\n<div class=\"main-image\"><iframe frameborder=\"0\" height=\"525\" src=\"//www.youtube.com/embed/6pA6VW3fzZs\" width=\"700\"></iframe></div>\r\n</div>\r\n<!--\r\n              =============================================================================\r\n              END TEMPLATE CODE\r\n              =============================================================================\r\n              -->", :parent_id => 2, :skin_id => 4, :link => "", :active => true },
  { :name => "entertainment-walls", :title => "Entertainment Walls", :created_at => "2013-08-05 18:34:43", :updated_at => "2013-10-03 01:46:20", :content => "<!--\r\n              =============================================================================\r\n              START TEMPLATE CODE\r\n              =============================================================================\r\n              -->\r\n\r\n          \r\n              <div class=\"section-container\">\r\n                <div class=\"framed\">\r\n                  <p>\r\n                    Home entertainment walls area a prefect balance of \r\n                    beauty and functionality. Display shelves, media storage, and wire \r\n                    management provide perfect solution for your electronics and home \r\n                    theater accessories. Choose the console that accommodates your TV, and \r\n                    pair it with the piers and bridge for an dlegant entertainment wall that\r\n                     will surely be the centerpiece of your media room.\r\n                  </p>\r\n                  <p class=\"note\">\r\n                    *Not all of our television consoles are designed for use in an entertainment wall; ask your retailer to help you create an \r\n                    entertainment wall that fits your needs.\r\n                  </p>\r\n                </div>\r\n                <div class=\"main-image\">\r\n                  <a href=\"collections/11\" title=\"Gravity Entertainment Wall\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1380755154/main_img_eurbet.jpg\">\r\n                  </a>\r\n                </div>\r\n                <div class=\"section-list\">\r\n                  <ul>\r\n                    <li>\r\n                      <div class=\"section-item\">\r\n                        <a href=\"compilations/41\" title=\"Carlton Entertainment Wall\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1380755154/carl