h2>\r\n                        <a href=\"collections/17\">View this collection</a>\r\n                      </h2>\r\n                    </li>\r\n                  </ul>\r\n                </div>\r\n              </div>\r\n            \r\n\r\n              <!--\r\n              =============================================================================\r\n              END TEMPLATE CODE\r\n              =============================================================================\r\n              -->", :parent_id => 2, :skin_id => 4, :link => "", :active => true },
  { :name => "office-solutions", :title => "Office Solutions", :created_at => "2013-08-05 18:36:08", :updated_at => "2013-10-17 19:19:29", :content => "", :parent_id => 1, :skin_id => 4, :link => "/sections/6", :active => true },
  { :name => "modular-office", :title => "Modular Office", :created_at => "2013-08-05 18:36:49", :updated_at => "2013-10-03 01:46:46", :content => "<!--\r\n              =============================================================================\r\n              START TEMPLATE CODE\r\n              =============================================================================\r\n              -->\r\n\r\n          \r\n              <div class=\"section-container\">\r\n                <div class=\"framed\">\r\n                  <p>\r\n                    Home office furniture has transitioned to smaller scale, functional, adaptable pieces that move into new parts of the home - living rooms, nooks and dens. Our modular office groupings, “<a href=\"#\">Flex</a>” and “<a href=\"#\">Peninsula Walls</a>” allow you to create the perfect office setup for your space. \r\n                  </p>\r\n                </div>\r\n                <div class=\"main-image\">\r\n                  <a href=\"/collections/19\" title=\"Mount View Flex Office\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1380755153/flex-main-img_esqpsf.jpg\">\r\n                  </a>\r\n                </div>\r\n                <div class=\"section-list\">\r\n                  <ul>\r\n                    <li>\r\n                      <div class=\"section-item\">\r\n                        <a href=\"/collections/4\" title=\"Carlton Flex Group\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1380755152/carlton-flex_l6wc9v.jpg\">\r\n                        </a>\r\n                      </div>\r\n                      <h1>\r\n                        Carlton Flex Group\r\n                      </h1>\r\n                      <h2>\r\n                        <a href=\"/collections/4\">View this collection</a>\r\n                      </h2>\r\n                    </li>\r\n                    <li>\r\n                      <div class=\"section-item\">\r\n                        <a href=\"/collections/18\" title=\"Mission Pasadena Flex Group\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1380755153/mission-pasadena-flex_hemvcu.jpg\">\r\n                        </a>\r\n                      </div>\r\n                      <h1>\r\n                        Mission Pasadena Flex Group\r\n                      </h1>\r\n                      <h2>\r\n                        <a href=\"/collections/18\">View this collection</a>\r\n                      </h2>\r\n                    </li>\r\n                    <li>\r\n                      <div class=\"section-item\">\r\n                        <a href=\"/collections/19\" title=\"Mount View Flex Group\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1380755153/mount-view-flex_hgov2u.jpg\">\r\n                        </a>\r\n                      </div>\r\n                      <h1>\r\n                        Mount View Flex Group\r\n                      </h1>\r\n                      <h2>\r\n                        <a href=\"/collections/19\">View this collection</a>\r\n                      </h2>\r\n                    </li>\r\n                  </ul>\r\n                </div>\r\n                <div class=\"framed\" style=\"margin-top: -40px;\">\r\n                  <p>\r\n                    Flex groups can be combined in a number of distinct ways to create custom setup solutions that fit your needs and space.  <a href=\"#\">Download the guide</a> for help visualizing some of the different ways you can arrange our Flex groups.\r\n                  </p>\r\n                </div>\r\n                <div class=\"separator\" style=\"margin-bottom: 40px;\"></div>\r\n                <div class=\"main-image\">\r\n                  <a href=\"/collections/24\" title=\"Tribeca Loft Black Peninsula Wall\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1380755154/peninsula-main-img_gnum9o.jpg\">\r\n                  </a>\r\n                </div>\r\n                <div class=\"section-list\">\r\n                  <ul>\r\n                    <li>\r\n                      <div class=\"section-item\">\r\n                        <a href=\"/collections/18\" title=\"Mission Pasadena Peninsula Wall\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1380755153/mission-pasadena-peninsula_s0pqos.jpg\">\r\n                        </a>\r\n                      </div>\r\n                      <h1>\r\n                        Mission Pasadena Peninsula Wall\r\n                      </h1>\r\n                      <h2>\r\n                        <a href=\"/collections/18\">View this collection</a>\r\n                      </h2>\r\n                    </li>\r\n                    <li>\r\n                      <div class=\"section-item\">\r\n                        <a href=\"/collections/24\" title=\"Tribeca Loft Black Peninsula Wall\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1380755154/tribeca-black-peninsula_f7ildp.jpg\">\r\n                        </a>\r\n                      </div>\r\n                      <h1>\r\n                        Tribeca Loft Black Peninsula Wall\r\n                      </h1>\r\n                      <h2>\r\n                        <a href=\"/collections/24\">View this collection</a>\r\n                      </h2>\r\n                    </li>\r\n                    <li>\r\n                      <div class=\"section-item\">\r\n                        <a href=\"/collections/24\" title=\"Tribeca Loft Cherry Peninsula Wall\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1380755154/tribeca-cherry-peninsula_spvwny.jpg\">\r\n                        </a>\r\n                      </div>\r\n                      <h1>\r\n                        Tribeca Loft Cherry Peninsula Wall\r\n                      </h1>\r\n                      <h2>\r\n                        <a href=\"/collections/24\">View this collection</a>\r\n                      </h2>\r\n                    </li>\r\n                  </ul>\r\n                </div>\r\n                <div class=\"framed\" style=\"margin-top: -40px;\">\r\n                  <p>\r\n                    Peninsula Walls can be combined in a number of distinct ways to create custom setup solutions that fit your needs and space. <a href=\"#\">Download the guide</a> for help visualizing some of the different ways you can arrange our Peninsula Walls.\r\n                  </p>\r\n                </div>\r\n              </div>\r\n            \r\n\r\n              <!--\r\n              =============================================================================\r\n              END TEMPLATE CODE\r\n              =============================================================================\r\n              -->", :parent_id => 5, :skin_id => 4, :link => "", :active => true },
  { :name => "power-connectivity-centers", :title => "Power/Connectivity Centers", :created_at => "2013-08-05 18:37:09", :updated_at => "2013-12-27 17:36:55", :content => "<!--\r\n              =============================================================================\r\n              START TEMPLATE CODE\r\n              =============================================================================\r\n              -->\r\n<div class=\"section-container\">\r\n<div class=\"framed\">\r\n<p>Many of our desks feature built-in power centers or wire management grommets that accommodate our Charge &amp; Connect unit. The Charge &amp; Connect unit combines easy-to-reach USB and power outlets in a convenient pop-up unit. Our power centers provide convenient desktop connectivity without cluttering your workspace.</p>\r\n</div>\r\n\r\n<div class=\"main-image\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1382047379/charge-connect-lrg_ruwrfw.jpg\" /></div>\r\n\r\n<div class=\"framed\">\r\n<p>Perfect for desks or conference tables, Charge &amp; Connect stays recessed below the surface when not in use and pops up to reveal USB and power outlets ideal for laptop and tablet use. Some desks can accommodate two or more &#39;Charge &amp; Connect&#39; units. <a href=\"/searches?utf8=%E2%9C%93&amp;product_search=charge+%26+connect\">See which desks are compatible with the Charge &amp; Connect unit</a> or download a complete list.</p>\r\n\r\n<p><strong>TO ORDER</strong><br />\r\nPlease contact the retailer where you purchased the desk or purchase online at <a href=\"http://office-accessories.nationalbusinessfurniture.com/Grommet-Charge-and-Connect-91738.aspx\" target=\"_blank\">National Business Furniture</a>.</p>\r\n</div>\r\n\r\n<div class=\"separator\" style=\"margin-bottom: 40px;\">&nbsp;</div>\r\n\r\n<div class=\"main-image\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1382047379/power-center-lrg_cj4ccu.jpg\" /></div>\r\n\r\n<div class=\"framed\">\r\n<p><a href=\"/searches?utf8=✓&amp;product_search=power+center\">See which desks provide convenient desktop power centers</a>.</p>\r\n</div>\r\n</div>\r\n<!--\r\n              =============================================================================\r\n              END TEMPLATE CODE\r\n              =============================================================================\r\n              -->", :parent_id => 5, :skin_id => 4, :link => "", :active => true },
  { :name => "quality-craftsmanship", :title => "Quality Craftsmanship", :created_at => "2013-08-05 18:37:29", :updated_at => "2013-09-11 23:25:15", :content => "<p>At Martin Home Furnishings quality means the finest in:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Style</strong>: Intricate detailing and coordinated artistic elements such as dentil molding and ringed pilasters combine to create the styles that enrich our customer&#39;s home or office.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Construction</strong>: From precision channel and dovetail drawers to full suspension ball bearing glides on all file drawers, our furniture is built to withstand the test of time.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Materials</strong>: Real wood veneers and hardwood solids are the standard at Martin Home Furnishings. Our finishing process uses up to 18 steps to produce clear, durable finishes that enhance the beauty of natural wood grain.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Craftsmanship</strong>: Intricate, hand-laid veneers and attention to detail allow us to consistently produce beautiful furniture. Craftsmanship and artistry skills combine to produce details such as hand-rubbed patina finishes and elaborate patterns.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Durability</strong>: We stand behind our products with a 5 year limited furniture warranty.</p>\r\n", :parent_id => 1, :skin_id => 4, :link => "", :active => true },
  { :name => "distressing", :title => "Distressing", :created_at => "2013-08-05 18:37:51", :updated_at => "2013-10-03 02:11:46", :content => "<!--\r\n              =============================================================================\r\n              START TEMPLATE CODE\r\n              =============================================================================\r\n              -->\r\n              <div class=\"section-container\">\r\n                <div class=\"framed\">\r\n                  <p>\r\n                    We understand the charm of old furniture and for that reason we distress some of our furniture to achieve the look of rustic beauty. Distressing is a method used to make furniture appear aged and less than perfect. It allows you to enjoy the beauty and prestige of antique furniture while also enjoying modern conveniences such as built-in power centers, charging stations and drop down keyboard/pencil drawers.\r\n                  </p>\r\n                  <p>\r\n                    The following collections feature distressing: <a href=\"#\">Southampton Onyx</a>, <a href=\"#\">Southampton Oyster</a>, <a href=\"#\">Tribeca Loft Black</a>, <a href=\"#\">Tribeca Loft Cherry</a>\r\n                  </p>\r\n                </div>\r\n                <div class=\"section-list\">\r\n                  <ul>\r\n                    <li>\r\n                      <div class=\"section-item\">\r\n                        <a href=\"#\" title=\"Hand-rubbed edges\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1380766162/tribeca-black-distress_o3gbzu.jpg\">\r\n                        </a>\r\n                      </div>\r\n                      <h1>\r\n                        Hand-rubbed edges\r\n                      </h1>\r\n                    </li>\r\n                    <li>\r\n                      <div class=\"section-item\">\r\n                        <a href=\"#\" title=\"Distressed painted finish\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1380766160/southampton-black-distress_gsxizt.jpg\">\r\n                        </a>\r\n                      </div>\r\n                      <h1>\r\n                        Distressed painted finish\r\n                      </h1>\r\n                    </li>\r\n                    <li>\r\n                      <div class=\"section-item\">\r\n                        <a href=\"#\" title=\"Destressed painted finish\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1380766161/southampton-white-distress_e2ajwh.jpg\">\r\n                        </a>\r\n                      </div>\r\n                      <h1>\r\n                        Destressed painted finish\r\n                      </h1>\r\n                    </li>\r\n                  </ul>\r\n                </div>\r\n              </div>\r\n              <!--\r\n              =============================================================================\r\n              END TEMPLATE CODE\r\n              =============================================================================\r\n              -->", :parent_id => 8, :skin_id => 4, :link => "", :active => true },
  { :name => "drawer-construction", :title => "Drawer Construction", :created_at => "2013-08-05 18:38:11", :updated_at => "2013-10-30 21:49:04", :content => "<p>All Kathy Ireland&trade; Home by Martin and Martin Home Furnishings products feature quality drawer construction that is designed to stand the test of time. All three of our drawer construction methods have subtle differences but are all very sturdy and are intended for use with hanging files only.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><strong>Ball Bearing Drawer Glide</strong></h2>\r\n\r\n<p>Ball Bearing Glides have commercial quality, quiet operation and support heavy loads (up to 50LBS)</p>\r\n\r\n<h2><strong>Euro-style Drawer Glide</strong></h2>\r\n\r\n<p>Euro-style slides have smooth operating metal glides for quiet and economical operation</p>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h2><strong>Precision Channel Drawer Construction</strong></h2>\r\n\r\n<p>Precision channel joint construction provides strong connection between drawer side and face</p>\r\n\r\n<h2><strong>Dovetail Drawer Construction</strong></h2>\r\n\r\n<p>Dovetail drawer joinery is the finest and most elegant expression of woodworking and craftsmanship</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<h2><strong>Premium Drawer</strong></h2>\r\n\r\n<ul>\r\n\t<li>Euro style drawer glides</li>\r\n\t<li>Precision channel joint construction</li>\r\n</ul>\r\n\r\n<h2><strong>Superior Drawer</strong></h2>\r\n\r\n<ul>\r\n\t<li>Full suspension ball bearing glides</li>\r\n\t<li>Precision channel joint construction</li>\r\n</ul>\r\n\r\n<h2><strong>Heirloom Drawer</strong></h2>\r\n\r\n<ul>\r\n\t<li>Full suspension ball bearing glides</li>\r\n\t<li>Dovetail joint construction</li>\r\n</ul>\r\n", :parent_id => 8, :skin_id => 4, :link => "", :active => true },
