  { :name => "furniture-care", :title => "Furniture Care", :created_at => "2013-08-05 18:38:51", :updated_at => "2013-09-11 20:23:02", :content => "<p>To care for your furniture, wipe with a soft dry cloth. Micro fiber cloths are recommended. To remove finger prints and other residue, we advise that you use EcoLab&#39;s Endust. To reduce residual finish odors when new, lemon scented Pledge by SC Johnson is recommended. Both Endust and lemon scented Pledge can be found at local drug stores. We also advise that you spray these cleaning products on to the cloth that you will use to wipe the furniture. It is best not to spray the cleaner directly on the finish.</p>\r\n\r\n<p>Use coasters to protect the surface from liquids. If your furniture becomes scratched of marred, furniture touch up pencils come in a variety of colors are available in most hardware stores and can be used to repair minor scratches.</p>\r\n\r\n<p>Avoid placing furniture directly near heat or air conditioning outlets. Exposure to extreme temperature variations can damage any fine wood furniture, including variations caused by humidifiers, heat vents and fire places.</p>\r\n\r\n<p><em><span style=\"font-size:10px\">**Martin Home Furnishings is not responsible for damage caused by the use of house hold cleaning products on any piece of furniture beyond what is recommended. The information on this page is a suggestion based on tests conducted by Martin Home Furnishings staff on Martin Home Furnishings products only.</span></em></p>\r\n\r\n<p>For warranty or replacement of your media storage, we refer you to Spectrum Concepts, our exclusive supplier - <a href=\"http://www.flipworks.com/furniture.html\" target=\"_blank\">http://www.flipworks.com/furniture.html</a>.</p>\r\n\r\n<p>You may also contact them directly from their web site at <a href=\"http://www.flipworks.com\" target=\"_blank\">www.flipworks.com</a>.</p>\r\n", :parent_id => 1, :skin_id => 4, :link => "", :active => true },
  { :name => "warranty-information", :title => "Warranty Information", :created_at => "2013-08-05 18:39:13", :updated_at => "2013-12-27 17:41:17", :content => "<p>All Martin Home Furnishings products carry a five year limited warranty to be free of manufacturing defects in workmanship. Component parts not manufactured by Martin Home Furnishings such as electrical light fixtures, light bulbs, and electrical power centers are warranted by those respective manufacturers. Cost of transportation to our factory will be the responsibility of the customer. After the item is returned to our factory, we will repair or replace with same or similar unit, at our discretion. If defective, the product will be repaired or replaced and shipped back to the dealer at no cost. This warranty is void if Martin Home Furnishings deems said damage was caused by abuse, negligence, modification, or by accident. Please contact the company for additional information.</p>\r\n\r\n<p><em><span style=\"font-size:10px\">**All warranties are limited to the original purchaser for normal residential use by persons weighing 200 lbs. or less. This warranty will not cover labor, freight or damage from misuse, abuse, negligence, accident, vandalism, rusting, acts of nature or any other event beyond the control of Martin Home Furnishings. The warranty does not cover cosmetic damage that may result from normal use. Liability for incidental or consequential damages is excluded to the extent permitted by law. The user assumes all risk of injury from use of this product. In no event will Martin Home Furnishings be liable for any incidental or consequential damages or for any loss or injury to person or PROPERTY, resulting from the manufacture, sale, and/or use of the chair, unless such exclusions are prohibited by state law.</span></em></p>\r\n\r\n<p>For warranty or replacement of your media storage, we refer you to Spectrum Concepts, our exclusive supplier - <a href=\"http://www.flipworks.com/furniture.html\" target=\"_blank\">http://www.flipworks.com/furniture.html</a>.</p>\r\n\r\n<p>You may also contact them directly from their web site at <a href=\"http://www.flipworks.com\" target=\"_blank\">www.flipworks.com</a>.</p>\r\n", :parent_id => 1, :skin_id => 4, :link => "", :active => true },
  { :name => "get-to-know-us", :title => "Get to Know Us", :created_at => "2013-08-05 18:39:29", :updated_at => "2013-12-27 17:53:12", :content => "", :parent_id => 0, :skin_id => 4, :link => "/sections/15", :active => true },
  { :name => "brand-info", :title => "Brand Info", :created_at => "2013-08-05 18:40:01", :updated_at => "2013-09-11 20:22:18", :content => "<p>Martin Home Furnishings is a leading manufacturer of first-rate quality and stylish furniture located in San Diego, California.&nbsp;&nbsp; Our product offerings include home office, entertainment and occasional furniture.&nbsp; We strive to provide the highest levels of customer satisfaction through designs, functionality, materials and the added value that our products explicitly convey when becoming part of the home or office.&nbsp; We invite you to experience our brands kathy ireland Home&trade; by Martin and Martin Home Furnishings.</p>\r\n\r\n<p>We are a wholesale company and distribute our products through exceptional and trusted retail furniture stores throughout the country. If you see a furniture collection that you like, please use our store locator to find the retail location nearest to you and contact them to purchase the collection.</p>\r\n", :parent_id => 14, :skin_id => 4, :link => "", :active => true },
  { :name => "martin-home-furnishings", :title => "Martin Home Furnishings", :created_at => "2013-08-05 18:40:21", :updated_at => "2013-12-29 17:17:03", :content => "<!--\r\n              =============================================================================\r\n              START TEMPLATE CODE\r\n              =============================================================================\r\n              -->\r\n<div class=\"section-container\">\r\n<div class=\"main-image\"><a href=\"/\" title=\"Martin Home Furnishings\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1380757848/e0vcxp5jng5g6e8tnuen.png\" /> </a></div>\r\n\r\n<div>\r\n<p>Martin Home Furnishings is a leading manufacturer of first-rate quality and stylish furniture located in San Diego, California.&nbsp;&nbsp; Our product offerings include home office, entertainment and occasional furniture.&nbsp; We strive to provide the highest levels of customer satisfaction through designs, functionality, materials and the added value that our products explicitly convey when becoming part of the home or office.&nbsp; We invite you to experience our brands kathy ireland Home&trade; by Martin and Martin Home Furnishings.</p>\r\n\r\n<p>We are a wholesale company and distribute our products through exceptional and trusted retail furniture stores throughout the country. If you see a furniture collection that you like, please use our <a href=\"/locations\">store locator</a> to find the retail location nearest to you and contact them to purchase the collection.</p>\r\n</div>\r\n\r\n<h2 class=\"sub-header\">Martin Home Furnishings Branded Collections</h2>\r\n\r\n<div class=\"section-list\">\r\n<ul>\r\n\t<li>\r\n\t<div class=\"section-item\"><a href=\"/collections/1\" title=\"Beaumont Collection\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1380758950/BeaumontCollection_bvge7j.jpg\" /> </a></div>\r\n\r\n\t<h1>Beaumont Collection</h1>\r\n\r\n\t<h2><a href=\"/collections/1\">View this collection</a></h2>\r\n\t</li>\r\n\t<li>\r\n\t<div class=\"section-item\"><a href=\"/collections/6\" title=\"Contemporary Collection\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1380758952/ContemporaryCollection_chpu2e.jpg\" /> </a></div>\r\n\r\n\t<h1>Contemporary Collection</h1>\r\n\r\n\t<h2><a href=\"/collections/6\">View this collection</a></h2>\r\n\t</li>\r\n\t<li>\r\n\t<div class=\"section-item\"><a href=\"/collections/9\" title=\"Fremont Entertainment Wall\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1380758952/FremontEntertainmentWall_ydzpoy.jpg\" /> </a></div>\r\n\r\n\t<h1>Fremont Entertainment Wall</h1>\r\n\r\n\t<h2><a href=\"/collections/9\">View this collection</a></h2>\r\n\t</li>\r\n\t<li>\r\n\t<div class=\"section-item\"><a href=\"/collections/11\" title=\"Gravity Entertainment Wall\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1380758952/GravityEntertainmentWall_utkmfj.jpg\" /> </a></div>\r\n\r\n\t<h1>Gravity Entertainment Wall</h1>\r\n\r\n\t<h2><a href=\"/collections/11\">View this collection</a></h2>\r\n\t</li>\r\n\t<li>\r\n\t<div class=\"section-item\"><a href=\"/collections/16\" title=\"Kyoto Collection\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1380758952/KyotoCollection_ux196c.jpg\" /> </a></div>\r\n\r\n\t<h1>Kyoto Collection</h1>\r\n\r\n\t<h2><a href=\"/collections/16\">View this collection</a></h2>\r\n\t</li>\r\n\t<li>\r\n\t<div class=\"section-item\"><a href=\"/collections/20\" title=\"Point Reyes Collection\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1380758952/PointReyesCollection_sesbfi.jpg\" /> </a></div>\r\n\r\n\t<h1>Point Reyes Collection</h1>\r\n\r\n\t<h2><a href=\"/collections/20\">View this collection</a></h2>\r\n\t</li>\r\n\t<li>\r\n\t<div class=\"section-item\"><a href=\"/collections/22\" title=\"San Ramon Collection\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1380758952/SanRamonCollection_zmnzdj.jpg\" /> </a></div>\r\n\r\n\t<h1>San Ramon Collection</h1>\r\n\r\n\t<h2><a href=\"/collections/22\">View this collection</a></h2>\r\n\t</li>\r\n\t<li>\r\n\t<div class=\"section-item\"><a href=\"/collections/25\" title=\"Waterfall Collection\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1380759863/WaterfallCollection_nph18n.jpg\" /> </a></div>\r\n\r\n\t<h1>Waterfall Collection</h1>\r\n\r\n\t<h2><a href=\"/collections/25\">View this collection</a></h2>\r\n\t</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<!--\r\n              =============================================================================\r\n              END TEMPLATE CODE\r\n              =============================================================================\r\n              -->", :parent_id => 15, :skin_id => 4, :link => "", :active => true },
  { :name => "kathy-ireland", :title => "Kathy Ireland", :created_at => "2013-08-05 18:40:38", :updated_at => "2013-12-29 15:37:43", :content => "<!--\r\n              =============================================================================\r\n              START TEMPLATE CODE\r\n              =============================================================================\r\n              -->\r\n<div class=\"section-container\">\r\n<p><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1382053121/ki_logo_cy0eua.jpg\" style=\"float:left; margin-bottom:10px; margin-right:20px\" />Kathy Ireland Worldwide (KIWW) is the design and marketing firm founded in 1993 by CEO and Chief Designer, Kathy Ireland. The primary mission of KIWW is &quot;&hellip;finding solutions for families, especially busy moms.&quot;</p>\r\n\r\n<p>Forbes Magazine reports that KIWW is a &quot;design empire which grosses over one billion dollars annually in retail sales.&quot; This year Newsweek reported, &quot;Annual sales run to $1.4 billion.&quot; KIWW products include flooring, rugs, home furniture, office and entertainment furniture, lighting, decorative accessories, window coverings, bedding, mattresses, candles, apparel, jewelry, blankets, hand painted porcelain, fire resistant products and top of bed fashions.</p>\r\n\r\n<p>In 2000, KIWW began expanding its mission and consumer needs, with the addition of the Portfolio of Brands, presenting &quot;Design Ambassadors&quot; ACaf&eacute; by Chef Andre for food and entertaining, and Jardin du Jour cultivated by Nicholas Walker for outdoor living and garden inspirations.</p>\r\n\r\n<p>KIWW teams with industry leaders in each category of business from home d&eacute;cor to fresh cut flowers. For more information, please visit <a href=\"http://kathyireland.com/\" target=\"_blank\">www.kathyireland.com</a>.</p>\r\n&nbsp;\r\n\r\n<p><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1382053605/americana_vprdkt.jpg\" style=\"float:left; margin-bottom:10px; margin-right:20px; margin-top:5px\" /> <strong>Americana Style Guide&trade;</strong> <em>...inspired by the diversity of America</em><br />\r\nElegant, yet relaxed and steeped in the very best of our country&#39;s heritage, the Americana Style Guide&trade; offers rustic simplicity at its finest. Americana seeks to embody the diversity and rich traditions of our nation through the use of subtle distressing and inspiration from colors such as Yellow Corn, Green Grass and Wheatfield Brown. Unique and intricate detailing, the use of an eclectic array of materials and incredible durability are the cornerstones of this traditional style.</p>\r\n&nbsp;\r\n\r\n<p><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1382053605/architectural_jtluho.jpg\" style=\"float:left; margin-bottom:10px; margin-right:20px; margin-top:5px\" /> <strong>Architectural Style Guide&trade;</strong> <em>...form follows function</em><br />\r\nThis style is deeply influenced by clean lines, minimalism and simplicity; where form follows function. Understated colors with an emphasis on neutral tones combine to produce a sophisticated, appealing and comfortable style. Products inspired by this Style Guide&trade; are designed to mix easily with furnishings and accessories from other time periods to create an unmistakably modern feel with impeccable flair.</p>\r\n&nbsp;\r\n\r\n<h2>kathy ireland&trade; Home by Martin Branded Collections</h2>\r\n\r\n<div class=\"section-list\">\r\n<ul>\r\n\t<li>\r\n\t<div class=\"section-item\"><a href=\"/collections/2\" title=\"Bradley\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/c_fill,h_150,w_220/v1377541573/ptupfewvi3gubats15cj.jpg\" /> </a></div>\r\n\r\n\t<h1>Bradley</h1>\r\n\r\n\t<h2><a href=\"/collections/2\">View this collection</a></h2>\r\n\t</li>\r\n\t<li>\r\n\t<div class=\"section-item\"><a href=\"/collections/3\" title=\"California Bungalow\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v13820589