nary.com/hmnxgsjti/image/upload/v1382057473/portlandloft_owhi28.jpg\" /> </a></div>\r\n\r\n\t<h1>Portland Loft</h1>\r\n\r\n\t<h2><a href=\"/collections/21\">View this collection</a></h2>\r\n\t</li>\r\n\t<li>\r\n\t<div class=\"section-item\"><a href=\"/collections/23\" title=\"Southampton\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1382057473/southampton_mlwldj.jpg\" /> </a></div>\r\n\r\n\t<h1>Southampton</h1>\r\n\r\n\t<h2><a href=\"/collections/23\">View this collection</a></h2>\r\n\t</li>\r\n\t<li>\r\n\t<div class=\"section-item\"><a href=\"/collections/24\" title=\"Mount View\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1382057473/tribecaloft-cherry_shvlja.jpg\" /> </a></div>\r\n\r\n\t<h1>Tribeca Loft</h1>\r\n\r\n\t<h2><a href=\"/collections/24\">View this collection</a></h2>\r\n\t</li>\r\n\t<li>\r\n\t<div class=\"section-item\"><a href=\"/collections/26\" title=\"WorX\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1382057473/worx_qcxgg0.jpg\" /> </a></div>\r\n\r\n\t<h1>WorX</h1>\r\n\r\n\t<h2><a href=\"/collections/26\">View this collection</a></h2>\r\n\t</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<!--\r\n              =============================================================================\r\n              END TEMPLATE CODE\r\n              =============================================================================\r\n              -->", :parent_id => 15, :skin_id => 4, :link => "", :active => true },
  { :name => "company", :title => "Company", :created_at => "2013-08-05 18:40:56", :updated_at => "2013-09-11 23:04:56", :content => "<p>In 1980, our founder, Gil Martin, resigned from his position at General Dynamics in San Diego, California and started a furniture company in his home garage with $400 in &quot;startup capital&quot; and a Sears Craftsman table saw. Thirty-one years later, while still privately held, Martin Home Furnishings has evolved into a leading international furniture designer, manufacturer and distributor. Our corporate offices and a 250,000 ft&sup2; distribution center are located in San Diego, California while Asia operations are managed from our offices located in Dongguang, China. In addition, we operate and control our own manufacturing facility in Mexico and partner with over 20 independently owned factories throughout Asia who manufacture furniture using our designs and specifications. Worldwide, Martin Home Furnishings has more than 500 employees.</p>\r\n\r\n<p>The guiding force that has defined the company and its products has been an unwavering commitment to quality and value. Our product specialties include office, home office, entertainment, and occasional furniture. Our portfolio of brands includes Martin Home Furnishings and the well-known and much respected kathy ireland Home&trade; by Martin.</p>\r\n\r\n<p>In April 2003, we became a brand partner of kathy ireland Worldwide (kiWW), where Kathy serves as CEO and chief designer. She began her business over 10 years ago with a commitment to &quot;finding solutions for families, especially busy moms.&quot; Kathy&#39;s additional Home design efforts range from flooring and home furnishings to jewelry and stemware. There are now well over 10,000 pieces that reflect Kathy&#39;s design philosophy and mission. Kathy&#39;s Home Collection, which we contribute to, received &quot;Best of Market&quot; honors and the Good Housekeeping Seal. For more information on KIWW and other brand partners, please visit <a href=\"http://www.kathyireland.com\" target=\"_blank\">www.kathyireland.com</a>.</p>\r\n\r\n<p>Martin Home Furnishings has well-established, long term business relationships with many of the top 100 as well as second and third tier domestic retailers. For more than 20 years we&#39;ve been providing proprietary products to membership warehouse clubs and finally, we were first a pioneer and today a recognized leader in order fulfillment for catalog and eCommerce companies.</p>\r\n", :parent_id => 14, :skin_id => 4, :link => "", :active => true },
  { :name => "sustainability-efforts", :title => "Sustainability Efforts", :created_at => "2013-08-05 18:41:20", :updated_at => "2013-12-27 18:24:29", :content => "<p>At Martin Home Furnishings, we continually strive to improve our sustainability efforts through our sourcing, manufacturing, packaging, and recycling operations. Our commitment and efforts toward sustainability will only continue to grow. We will continue to reduce waste and use sustainable resources to meet your needs. Perhaps most important of all, these efforts result in more efficient operations and cost savings which we are able to pass on to you, our customers. We thank you for your business.&nbsp; <a href=\"http://esales.martinfurniture.com/downloads/MHF_SustainabilityInitiatives.pdf\" target=\"_blank\">Download a copy of our sustainability initiatives</a>.</p>\r\n\r\n<p><strong>Easy on the Planet</strong> - Committed to sustainable forestry<br />\r\n<strong>Easy on the Air</strong> - Built with panels emitting low or no formaldehyde<br />\r\n<strong>Built Locally</strong> - Manufacturing just 6.5 miles from our San Diego warehouse drastically reduces carbon emissions and fuel consumption</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Sourcing</strong><br />\r\n<em>Easy on the Planet </em></p>\r\n\r\n<p>Wood, the most important raw material for Martin, is both renewable and recyclable, making it a sound environmental choice provided it comes from responsibly managed forests. We are committed to working with suppliers and manufacturers that implement the Sustainable Forest Initiative (SFI). SFI Inc, is an independent, non-profit organization responsible for maintaining, overseeing and improving a sustainable forestry certification program internationally recognized as the largest single forest standard in the world. The SFI label certifies that wood and paper products come from well-managed forests, backed by rigorous, third-party certification audits. We purchase raw materials harvested from forests that meet stringent environmental standards and work closely with suppliers that comply with applicable federal, state and local laws.</p>\r\n\r\n<p><em>Easy on the Air </em></p>\r\n\r\n<p>In 2009, the California Air Resources Board (CARB) implemented new limits which will be fully in place by 2012 for formaldehyde emitted from composite wood panels. The new regulations establish the toughest production standard in the world for formaldehyde emissions from composite wood panels. All Martin products are CARB compliant.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Manufacturing</strong><br />\r\n<em>Easy on the Planet </em></p>\r\n\r\n<p>Martin Home Furnishings is a proud member of the Sustainable Furnishings Council (SFC). The SFC is a coalition of home furnishings industry and environmental leaders who are committed to sustainable practices and raising awareness in the furniture industry.</p>\r\n\r\n<p><em>Easy on the Air</em></p>\r\n\r\n<p>Martin&#39;s North American manufacturing facility is only 6.5 miles from its San Diego warehouse. This proximity allows us to drastically reduce carbon emissions and fuel consumption compared to importing products by container ships, considered to be a significant source of air pollution through exhaust emissions. One giant container ship emits about the same amount of cancer and asthma-causing chemicals as 50 million cars!</p>\r\n\r\n<p><em>Built Locally </em></p>\r\n\r\n<p>Mindful of climate change, Martin works actively to reduce carbon dioxide emissions and fuel consumption from operations. We have a North American manufacturing facility that is only 6.5 miles from our San Diego warehouse.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Packaging</strong><br />\r\n<em>Easy on the Planet</em></p>\r\n\r\n<p>Martin continually works to improve packaging to maximize the use of space, the most effective way to reduce the environmental impact of transportation. Whenever possible we reduce the amount of packaging material used in shipping, less packaging equating to less waste.</p>\r\n\r\n<p><em>Easy on the Air</em></p>\r\n\r\n<p>We also use biodegradable packaging materials. Our corner protectors are made from polyurethane foam covered with polyethylene film. They not only provide superior protection with less material, but they can be disposed of with ordinary waste or be processed in municipal waste-to-energy facilities, leaving less that 1% residual ash, much less than paper or wood, The foam compacts to 10% of its original volume in a landfill and will not degrade into pollutants of air or groundwater. It is produced without chlorofluorocarbons (CFCs) or hydrochlorofluorocarbons (HFCs) associated with the depletion of the ozone layer and can be turned into any of over 20 worldwide foam-return locations.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Recycling</strong><br />\r\n<em>Easy on the Planet </em></p>\r\n\r\n<p>All scrap cardboard, metal and paper packaging by-products from our North American factory are given to a recycler. The sawdust and wood scraps are then used to make particle board and to fuel a manufacturer&#39;s boiler. Our North American factory recycles approximately 130, 374 pounds of corrugated material each year.</p>\r\n\r\n<p><em>Easy on the Air </em></p>\r\n\r\n<p>Our corporate office and warehouses have also adopted green practices. Our corporate office participates in a paper shredding and recycling program, which saved an estimated 100 trees from destruction in 2009. Trees absorb vast amounts of harmful carbon dioxide from the air each day and we strive to save as many trees as possible thorough our recycling efforts.</p>\r\n\r\n<p>&nbsp;</p>\r\n", :parent_id => 14, :skin_id => 4, :link => "", :active => true },
  { :name => "news-releases", :title => "News Releases", :created_at => "2013-08-05 18:41:42", :updated_at => "2013-10-21 23:48:48", :content => "<!--\r\n              =============================================================================\r\n              START TEMPLATE CODE\r\n              =============================================================================\r\n              -->\r\n<div class=\"section-container\">\r\n<div class=\"section-list\">\r\n<ul>\r\n\t<li>\r\n\t<div class=\"section-item\"><a href=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1382137255/pr2011_005_iumzsq.pdf\" title=\"MHF Introduces Customer Satisfaction Team\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1382137894/pdf_ala3qd.jpg\" /> </a></div>\r\n\r\n\t<h1>Martin Home Furnishings Introduces Customer Satisfaction Team</h1>\r\n\r\n\t<h2><a href=\"/sections/48\">Read article</a></h2>\r\n\r\n\t<h2><a href=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1382137255/pr2011_005_iumzsq.pdf\" target=\"_blank\">Download article</a></h2>\r\n\t</li>\r\n\t<li>\r\n\t<div class=\"section-item\"><a href=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1382137256/pr2011_002_inbdcs.pdf\" title=\"kathy ireland™ Worldwide® and kathy ireland™ Home by Martin Renew Agreement &amp; Expand their Partnership\"><img src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1382137894/pdf_ala3qd.jpg\" /> </a></div>\r\n\r\n\t<h1>KIWW and kathy ireland&trade; Home by Martin Renew Agreement &amp; Expand their Partnership</h1>\r\n\r\n\t<h2><a href=\"/sections/51\">Read article</a></h2>\r\n\r\n\t<h2><a href=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1382137256/pr2011_002_inbdcs.pdf\" target=\"_blank\">Download article</a></h2>\r\n\t</li>\r\n\t<li>\r\n\t<div class=\"section-item\"><a href=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1382137256/pr2010_005_saz6hd.pdf\" title=\"Martin Product Awared Best Buy in Consumers Digest\"><img src=\"http://res.cloudinary.com/h