sjti/image/upload/v1382137894/pdf_ala3qd.jpg\" /> </a></div>\r\n\r\n\t<h1>Martin Home Furnishings Announces Major Expansion of High Point Presence</h1>\r\n\r\n\t<h2><a href=\"/sections/53\">Read article</a></h2>\r\n\r\n\t<h2><a href=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1382137256/pr2010_001_schviz.pdf\" target=\"_blank\">Download article</a></h2>\r\n\t</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<!--\r\n              =============================================================================\r\n              END TEMPLATE CODE\r\n              =============================================================================\r\n              -->", :parent_id => 14, :skin_id => 4, :link => "", :active => true },
  { :name => "legal-privacy-policy", :title => "Legal/Privacy Policy", :created_at => "2013-08-05 18:42:12", :updated_at => "2013-09-11 20:42:24", :content => "<p>Martin Home Furnishings reserves the right to make modifications in size, price, finish, and style without notice. Dimensions for all products are rounded and include moldings.</p>\r\n\r\n<p>Photographic representations of wood finishes and fabric colors may deviate slightly from the actual product due to computer monitor color variations. We highly recommend that you contact your online or local retailer for a finish sample.</p>\r\n", :parent_id => 14, :skin_id => 4, :link => "", :active => true },
