  { :name => "get-in-touch", :title => "Get In Touch", :created_at => "2013-08-05 18:43:40", :updated_at => "2013-09-11 20:44:47", :content => "<p><strong>Phone</strong><br />\r\n1-800-268-5669</p>\r\n\r\n<p><strong>Fax</strong><br />\r\n1-619-671-5199</p>\r\n\r\n<p><strong>Mailing Address</strong><br />\r\n2345 Britannia Boulevard<br />\r\nSan Diego, CA 92154</p>\r\n\r\n<p><strong>Business Hours</strong><br />\r\n7:00AM - 5:00PM Pacific Time</p>\r\n\r\n<p><strong>Email Us</strong><br />\r\n<a href=\"mailto:info@martinfurniture.com\">info@martinfurniture.com</a></p>\r\n\r\n<p>Or fill out the form below...<br />\r\n<em>Required Information*</em></p>\r\n", :parent_id => 23, :skin_id => 5, :link => "", :active => true },
  { :name => "customer-satisfaction-department", :title => "Customer Satisfaction Department", :created_at => "2013-08-05 18:44:03", :updated_at => "2013-09-11 20:52:27", :content => "<p>Please direct all questions and concerns regarding product dimensions, defects, broken parts and general questions to any of our friendly customer satisfaction representatives.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Rafael</strong><br />\r\nCustomer Satisfaction Supervisor<br />\r\nContact Rafael: <a href=\"mailto:rafaelcarrillo@martinfurniture.com\">rafaelcarrillo@martinfurniture.com</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Bertha</strong><br />\r\nCustomer Satisfaction Lead and Point-of-Purchase Materials Specialist<br />\r\nContact Bertha: <a href=\"mailto:berthaburton@martinfurniture.com\">berthaburton@martinfurniture.com</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Eric</strong><br />\r\nEast Coast, Northern California, Washington, Oregon and Idaho Account Specialist<br />\r\nContact Eric: <a href=\"mailto:e.chavez@martinfurniture.com\">e.chavez@martinfurniture.com</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Elena</strong><br />\r\nWarehouse Club and Catalog, Arizona, New Mexico and Southern California Account Specialist<br />\r\nContact Elena: <a href=\"mailto:e.prieto@martinfurniture.com\">e.prieto@martinfurniture.com</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Lora Jones </strong><br />\r\nParts Specialist<br />\r\nContact Lora: <a href=\"mailto:parts.order@martinfurniture.com\">parts.order@martinfurniture.com</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Monica</strong><br />\r\nMidwest States, Southern California, Colorado, Utah and Wyoming Account Specialist<br />\r\nContact Monica: <a href=\"mailto:m.ocampo@martinfurniture.com\">m.ocampo@martinfurniture.com</a></p>\r\n\r\n<p>&nbsp;</p>\r\n", :parent_id => 23, :skin_id => 4, :link => "", :active => true },
  { :name => "media-marketing", :title => "Media & Marketing", :created_at => "2013-08-05 18:44:31", :updated_at => "2013-10-17 22:50:44", :content => "<p>For all media and marketing questions, please contact Andrea Vela via email at <a href=\"mailto:a.vela@martinfurniture.com\">a.vela@martinfurniture.com</a></p>\r\n", :parent_id => 23, :skin_id => 4, :link => "", :active => true },
