  { :name => "faq", :title => "FAQ", :created_at => "2013-08-05 18:46:33", :updated_at => "2013-10-17 19:18:39", :content => "", :parent_id => 22, :skin_id => 4, :link => "/sections/29", :active => true },
  { :name => "consumer-faq", :title => "Consumer FAQ", :created_at => "2013-08-05 18:46:57", :updated_at => "2013-09-11 21:13:00", :content => "<p><span style=\"font-size:12px\"><a id=\"Top\" name=\"Top\"></a><a href=\"#01\">Do you sell directly to the public?</a></span></p>\r\n\r\n<p><span style=\"font-size:12px\"><a href=\"#02\">Where can I purchase your furniture?</a></span></p>\r\n\r\n<p><span style=\"font-size:12px\"><a href=\"#03\">What kind of furniture do you make?</a></span></p>\r\n\r\n<p><span style=\"font-size:12px\"><a href=\"#04\">I purchased one of your products and it arrived damaged, what should I do?</a></span></p>\r\n\r\n<p><span style=\"font-size:12px\"><a href=\"#05\">How do you construct your products?</a></span></p>\r\n\r\n<p><span style=\"font-size:12px\"><a href=\"#06\">Do your products contain lead?</a></span></p>\r\n\r\n<p><span style=\"font-size:12px\"><a href=\"#07\">How do I order a product catalog?</a></span></p>\r\n\r\n<p><span style=\"font-size:12px\"><a href=\"#08\">Can you tell me how to find a specific item in my area?</a></span></p>\r\n\r\n<p><span style=\"font-size:12px\"><a href=\"#09\">How do I order replacement parts?</a></span></p>\r\n\r\n<p><span style=\"font-size:12px\"><a href=\"#10\">Where can I get a replacement instruction sheet?</a></span></p>\r\n\r\n<p><span style=\"font-size:12px\"><a href=\"#11\">How do I remove a drawer from one of your units?</a></span></p>\r\n\r\n<p><span style=\"font-size:12px\"><a href=\"#12\">I can&#39;t find an item on your website, what should I do?</a></span></p>\r\n\r\n<p><span style=\"font-size:12px\"><a href=\"#13\">I am looking for Kathy Ireland Home bedroom or dining furniture, where can I find it?</a></span><br />\r\n<br />\r\n<span style=\"font-size:12px\"><a href=\"#14\">My pull-out media tray broke, who should I contact regarding a replacement?</a></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:12px\"><strong><a id=\"01\" name=\"01\"></a>Do you sell directly to the public?</strong><br />\r\nWe do not. We are a wood furniture manufacturer and we distribute our products to fine retail stores and warehouse clubs throughout the country. Please visit our Store Locator to find the nearest authorized retail store. </span><br />\r\n<a href=\"#Top\"><span style=\"font-size:12px\">Back to top</span></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:12px\"><strong><a id=\"02\" name=\"02\"></a>Where can I purchase your furniture?</strong><br />\r\nPlease visit our Store Locator to find the nearest authorized Kathy Ireland Home by Martin dealer.<br />\r\n<a href=\"#Top\">Back to top</a></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:12px\"><strong><a id=\"03\" name=\"03\"></a>What kind of furniture do you make?</strong><br />\r\nWe design and manufacture wood home office and home entertainment furniture with matching accent tables. You will find TV stands, end tables, coffee tables, writing desks, computer desks, armoires and so much more on our website.<br />\r\n<a href=\"#Top\">Back to top</a></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:12px\"><strong><a id=\"04\" name=\"04\"></a>I purchased one of your products and it arrived damaged, what should I do?</strong><br />\r\nPlease contact the company from whom you purchased the product as soon as possible, they will be able to assist you. </span><br />\r\n<span style=\"font-size:12px\"><a href=\"#Top\">Back to top</a></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:12px\"><strong><a id=\"05\" name=\"05\"></a>How do you construct your products?</strong><br />\r\nOur furniture is crafted using only the best quality wood products. We use a variety of hardwoods for the solid portions of our furniture. Species utilized to date include oak, alder, poplar, ash and cherry. </span></p>\r\n\r\n<p><span style=\"font-size:12px\">Our furniture has a sturdy core constructed with engineered wood panels to ensure durability; the exterior of the furniture features hand select wood veneers and hardwood solids. Wood veneers are thin sheet of wood that is adhered to a solid wood surface. Using wood veneers over a stable substrate helps prevent cracking, warping, and other common problems with furniture constructed solely with solid wood.<br />\r\n<a href=\"#Top\">Back to top</a></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:12px\"><strong><a id=\"06\" name=\"06\"></a>Do your products contain lead?</strong><br />\r\nNo, we had our North American as well as Asian produced products tested for lead content, here are the results: Painted and lacquer finishes, hardware, grommets, hinges and drawer glides from several collections were tested by an independent lab in Hong Kong, China. Our Charlotte, Mount View, Southampton Onyx, Southampton Oyster, Tribeca Loft Black and Tribeca Loft white complied with the Total Lead content requirement of 660PPM/0.06% maximum. </span></p>\r\n\r\n<p><span style=\"font-size:12px\">We tested the finishes on products that were stored in their warehouse facility in China. This ensured that the products tested were accurate representations of KIHBM stock. All finish surfaces tested received a &quot;GOOD&quot; rating with total lead content less than 50PPM (&lt;.0050%), which is below the safe, legal limit. </span></p>\r\n\r\n<p><span style=\"font-size:12px\">A written statement from our North American supplier Chemcraft indicates that none of the products that they supply to us for construction contain any lead. This applies to all North American produced products.<br />\r\n<a href=\"#Top\">Back to top</a></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:12px\"><strong><a id=\"07\" name=\"07\"></a>How do I order a product catalog?</strong><br />\r\nWe do not offer a printed catalog to consumers, but you may browse all available products on our website. </span><br />\r\n<span style=\"font-size:12px\"><a href=\"#Top\">Back to top</a></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:12px\"><strong><a id=\"08\" name=\"08\"></a>Can you tell me how to find a specific item in my area?</strong><br />\r\nUnfortunately we cannot tell you exactly which products our authorized retailers carry, but the Retailer Locator will provide a list of stores in your area that you may contact directly to find out if they have the item you are looking for in stock. </span></p>\r\n\r\n<p><span style=\"font-size:12px\">You may also visit our sales representative contact page and email the associate from your state; he or she should be able to point you in the right direction.<br />\r\n<a href=\"#Top\">Back to top</a></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:12px\"><strong><a id=\"09\" name=\"09\"></a>How do I order replacement parts?</strong><br />\r\nPlease first contact the company from whom you purchased the product, they should be able to assist you with ordering a replacement part. If they do not provide sufficient assistance, please call us at 800.268.5669 and ask for the parts department. Our Parts Department will be able to assist in identifying exactly which part of your furniture needs to be replaced and place the order for you. </span></p>\r\n\r\n<p><span style=\"font-size:12px\">For items purchased at Costco: please do not call Costco. Instead please call our parts department, 800.268.5669, they will be able to assist in identifying exactly which part of your furniture needs to be replaced and place the order for you.<br />\r\n<a href=\"#Top\">Back to top</a></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:12px\"><strong><a id=\"10\" name=\"10\"></a>Where can I get a replacement instruction sheet?</strong><br />\r\nPlease call our customer service department, 800.268.5669; they can assist in identifying which instruction sheet to send to you via email.<br />\r\n<a href=\"#Top\">Back to top</a></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:12px\"><strong><a id=\"11\" name=\"11\"></a>How do I remove a drawer from one of your units?</strong><br />\r\nPlease download one of the following instruction sheets for written and visual instructions on how to remove drawers: </span></p>\r\n\r\n<p><span style=\"font-size:12px\">Drawer Removal Instruction Sheet- General Drawer Removal </span></p>\r\n\r\n<p><span style=\"font-size:12px\">Drawer Removal Instruction Sheet- Tribeca Loft Collection </span></p>\r\n\r\n<p><span style=\"font-size:12px\">Drawer Removal Instruction Sheet- Lateral File Drawer Removal Instruction Sheet- Telescope Slides </span></p>\r\n\r\n<p><span style=\"font-size:12px\"><a href=\"#Top\">Back to top</a></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:12px\"><strong><a id=\"12\" name=\"12\"></a>I can&#39;t find an item on your website, what should I do?</strong><br />\r\nThe item may be discontinued or an exclusive design for a specific store. In either case, please call our customer service department for assistance, 800.268.5669.<br />\r\n<a href=\"#Top\">Back to top</a></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:12px\"><strong><a id=\"13\" name=\"13\"></a>I am looking for Kathy Ireland Home bedroom or dining furniture, where can I find it?</strong><br />\r\nPlease visit Kathy Ireland Home by Standard&#39;s website for more information on their bedroom and dining products, <a href=\"http://www.standard-furntiure.com\" target=\"_blank\">www.standard-furntiure.com</a>. For information on other Kathy Ireland Home products please visit <a href=\"http://www.kathyireland.com\" target=\"_blank\">www.kathyireland.com</a>.<br />\r\n<a href=\"#Top\">Back to top</a></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:12px\"><strong><a id=\"14\" name=\"14\"></a>My pull-out media tray broke, who should I contact regarding a replacement?</strong><br />\r\nFor warranty or replacement of your media storage, we refer you to Spectrum Concepts, our exclusive supplier - <a href=\"http://www.flipworks.com/furniture.html\" target=\"_blank\">http://www.flipworks.com/furniture.html</a>. </span></p>\r\n\r\n<p><span style=\"font-size:12px\">You may also contact them directly from their web site at <a href=\"http://www.flipworks.com\" target=\"_blank\">www.flipworks.com</a>.<br />\r\n<a href=\"#Top\">Back to top</a></span></p>\r\n\r\n<p>&nbsp;</p>\r\n", :parent_id => 28, :skin_id => 4, :link => "", :active => true },
  { :name => "retailer-faq", :title => "Retailer FAQ", :created_at => "2013-08-05 18:47:16", :updated_at => "2013-09-11 21:33:30", :content => "<p><a id=\"Top\" name=\"Top\"></a></p>\r\n\r\n<p><a href=\"#01\">I have questions about my order, who should I contact?</a></p>\r\n\r\n<p><a href=\"#02\">How can I find a Sales Representative near me?</a></p>\r\n\r\n<p><a href=\"#03\">I am interested in carrying your products in my furniture store, how can I establish an account with you?</a></p>\r\n\r\n<p><a href=\"#04\">How do I order printed catalogs and other point-of-purchase materials?</a><a href=\"#05\">I lost my copy of your price list, how do I obtain another?</a></p>\r\n\r\n<p><a href=\"#06\">Which tradeshows do you attend?</a></p>\r\n\r\n<p><a href=\"#07\">Who do I contact regarding advertising materials and product images?</a></p>\r\n\r\n<p><a href=\"#08\">Who should I contact for media inquiries?</a></p>\r\n\r\n<p><a href=\"#09\">I am a current customer and I would like my store(s) to be listed on your store locator, who should I contact?</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a id=\"01\" name=\"01\"></a></p>\r\n\r\n<p><strong>I have questions about my order, who should I contact?</strong><br />\r\nPlease refer to our Customer Service department contact page to locate the customer service specialist for your store.<br />\r\n<a href=\"#Top\">Back to top</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><a id=\"02\" name=\"02\"></a></strong></p>\r\n\r\n<p><strong>How can I find a Sales Representative near me?</strong><br />\r\nVisit our Find a Sales Representative page to find and contact the sales representative for your state.<br />\r\n<a href=\"#Top\">Back to top</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><a id=\"03\" name=\"03\"></a></strong></p>\r\n\r\n<p><strong>I am interested in carrying your products in my furniture store, how can I establish an account with you?</strong><br />\r\nVisit our Find a Sales Representative page to contact the sales representative for your state. He or she will be able to answer any questions you might have about opening orders, pricing and logistics.<br />\r\n<a href=\"#Top\">Back to top</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><a id=\"04\" name=\"04\"></a></strong></p>\r\n\r\n<p><strong>How do I order printed catalogs and other point-of-purchase materials?</strong><br />\r\nPlease call your customer service representative or your sales representative to place an order for catalogs or other point-of-purchase materials, 800.268.5669.<br />\r\n<a href=\"#Top\">Back to top</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><a id=\"05\" name=\"05\"></a></strong></p>\r\n\r\n<p><strong>I lost my copy of your price list, how do I obtain another?</strong><br />\r\nAt the beginning of each year we mail one hard copy of our price list to every customer. If you should lose your copy or need additional copies for your store or sales team, please contact our customer service department and they will be happy to email you a PDF version of the price list that you need. This way you can print the price list at your convenience.<br />\r\n<a href=\"#Top\">Back to top</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><a id=\"06\" name=\"06\"></a></strong></p>\r\n\r\n<p><strong>Which tradeshows do you attend?</strong><br />\r\nWe maintain a permanent showroom at the following furniture market:</p>\r\n\r\n<p>High Point - Furniture Plaza<br />\r\nSpace 512<br />\r\n210 South Main Street<br />\r\nHigh Point, NC 27260</p>\r\n\r\n<p><a href=\"#Top\">Back to top</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><a id=\"07\" name=\"07\"></a></strong></p>\r\n\r\n<p><strong>Who do I contact regarding advertising materials and product images?</strong><br />\r\nIf you are a current customer and have already registered for a username and password, all product images are available to you once you have logged in. Under Marketing Materials, there is a link that reads &quot;CD Catalog- Pictures,&quot; this link gives you instant access to high and low resolution jpegs of all current products.</p>\r\n\r\n<p>You may also request a copy of our CD catalog by calling our customer service department, 800.268.5669.</p>\r\n\r\n<p>If you are in a time crunch and require less than 5 images, please email Christine Takara at <a href=\"mailto:c.takara@martinfurniture.com\">c.takara@martinfurniture.com</a> with the following information: KIHBM model numbers of the products for which you need imagery, how soon you need it, the email address to which they should be sent, and the name of your store or client.<br />\r\n<a href=\"#Top\">Back to top</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><a id=\"08\" name=\"08\"></a></strong></p>\r\n\r\n<p><strong>Who should I contact for media inquiries?</strong><br />\r\nPlease contact Christine Takara at 800.268.5669.<br />\r\n<a href=\"#Top\">Back to top</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><a id=\"09\" name=\"09\"></a></strong></p>\r\n\r\n<p><strong>I am a current customer and I would like my store(s) to be listed on your store locator, who should I contact?</strong><br />\r\nPlease email Christine Takara and include the following information: store name, full address and phone number. We cannot list fax numbers or website addresses.<br />\r\n<a href=\"#Top\">Back to top</a></p>\r\n", :parent_id => 28, :skin_id => 4, :link => "", :active => true },
