  { :name => "esalesforce", :title => "eSalesForce", :created_at => "2013-08-05 18:54:06", :updated_at => "2013-08-05 18:54:06", :content => "", :parent_id => 38, :skin_id => 4, :link => nil, :active => true },
  { :name => "commonly-used-forms", :title => "Commonly Used Forms", :created_at => "2013-08-05 18:55:01", :updated_at => "2013-12-28 03:48:31", :content => "", :parent_id => 38, :skin_id => 6, :link => "/pages/6", :active => true },
  { :name => "faq-sales-reps", :title => "FAQ - Sales Reps", :created_at => "2013-08-05 18:55:25", :updated_at => "2013-09-13 17:38:02", :content => "<p><a id=\"Top\" name=\"Top\"></a></p>\r\n\r\n<p><a href=\"#01\">I found a discrepancy on a price list, who should I call?</a></p>\r\n\r\n<p><a href=\"#02\">eSalesforce seems to be down, who should I call?</a></p>\r\n\r\n<p><a href=\"#03\">I found an error on the website or in the printed catalog, who should I notify?</a></p>\r\n\r\n<p><a href=\"#04\">My customer would like to order a custom mini banner. How can I make this happen?</a></p>\r\n\r\n<p><a href=\"#05\">My customer is not listed on the dealer locator, who can fix this?</a></p>\r\n\r\n<p><a href=\"#06\">What is the policy regarding POP?</a></p>\r\n\r\n<p><a href=\"#07\">I want to see if something is in stock, how can I find out?</a></p>\r\n\r\n<p><a href=\"#08\">Do we have any tape measures or other promotional items?</a></p>\r\n\r\n<p><a href=\"#09\">Will Kathy make a store appearance?</a></p>\r\n\r\n<p><a href=\"#10\">I would like Kathy to call one of my customers, how can I make this happen?</a></p>\r\n\r\n<p><a href=\"#11\">Who is my CSR?</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a id=\"01\" name=\"01\"></a></p>\r\n\r\n<p><strong>I found a discrepancy on a price list, who should I call?</strong><br />\r\n<a href=\"mailto:paultabeek@martinfurniture.com\">Paul Tabeek</a>, he is responsible for creating all price lists.<br />\r\n<a href=\"#Top\">Back to top</a></p>\r\n\r\n<p><a id=\"02\" name=\"02\"></a></p>\r\n\r\n<p><strong>eSalesforce seems to be down, who should I call?</strong><br />\r\nFirst notify <a href=\"mailto:rafaelcarrillo@martinfurniture.com\">Rafael</a> and he will notify the IT department.<br />\r\n<a href=\"#Top\">Back to top</a></p>\r\n\r\n<p><a id=\"03\" name=\"03\"></a></p>\r\n\r\n<p><strong>I found an error on the website or in the printed catalog, who should I notify?</strong><br />\r\nPlease call Christine or send her an email with the error. If it&#39;s on the website, she&#39;ll have it fixed as soon as possible. If it&#39;s in the catalog, she&#39;ll make a note of it and have it fixed for the next printed catalog.<br />\r\n<a href=\"#Top\">Back to top</a></p>\r\n\r\n<p><a id=\"04\" name=\"04\"></a></p>\r\n\r\n<p><strong>My customer would like to order a custom mini banner. How can I make this happen?</strong><br />\r\nThis order will need to be discussed with Christine. Please send her an initial email with the following information:</p>\r\n\r\n<ol style=\"margin-left:40px\">\r\n\t<li>What store is requesting the mini banner?</li>\r\n\t<li>How many will need to be printed (be sure to note if the customer will need mini banners, many customers already have them in their stores)?</li>\r\n\t<li>What product will be showcased (exact SKUs or an entire collection)?</li>\r\n\t<li>Should the Kathy Ireland Home brand be include on the banner?</li>\r\n\t<li>Would the customer like their logo on the banner? If so please ask them to provide it in vector format (ie: eps, png, ai file).</li>\r\n\t<li>Any other special requests from the customer.</li>\r\n\t<li>If you have ideas on how the banner should be laid out please make a sketch and fax it to Christine, 619-671-5160 - anything will suffice.<br />\r\n\t&nbsp;</li>\r\n</ol>\r\n\r\n<p>You should allow one week for the artwork to be produced and depending on the quantity, up to two weeks for printing. Orders smaller than 75 can be produced in house and take less time; larger orders need to be sent to a printing company and take two weeks to print.<br />\r\n<a href=\"#Top\">Back to top</a></p>\r\n\r\n<p><a id=\"05\" name=\"05\"></a></p>\r\n\r\n<p><strong>My customer is not listed on the dealer locator, who can fix this?</strong><br />\r\nPlease email Christine Takara and include the following information: store name, full address and phone number. We cannot list fax numbers or website addresses. Please do not send Christine the customer ID number, the information in our system usually differs from the store front address.</p>\r\n\r\n<p>Please note that the sales rep is responsible for making sure all of their customers are listed on the store locator. When a new account is established Christine will add the store locations to the website if requested. We do not, however, automatically list all customers and their locations.<br />\r\n<a href=\"#Top\">Back to top</a></p>\r\n\r\n<p><a id=\"06\" name=\"06\"></a></p>\r\n\r\n<p><strong>What is the policy regarding POP?</strong><br />\r\nPlease submit all POP requests to the customer service department. Please use the POP form provided on our website.</p>\r\n\r\n<p>We will send marketing materials to you in the most cost effective way, usually via UPS or FedEx ground service. Expedited service often doubles the cost of the order. If you need something overnight due to an urgent request, please have a Fed Ex account number and be prepared to pay the costs associated with the expedited delivery.<br />\r\n<a href=\"#Top\">Back to top</a></p>\r\n\r\n<p><a id=\"07\" name=\"07\"></a></p>\r\n\r\n<p><strong>I want to see if something is in stock, how can I find out?</strong><br />\r\nPlease login to eSalesforce and print out a copy of the San Diego Warehouse Stock Status report or the Mixed China Warehouse Stock Status report. These are updated frequently and contain inventory information for all available SKUs.<br />\r\n<a href=\"#Top\">Back to top</a></p>\r\n\r\n<p><a id=\"08\" name=\"08\"></a></p>\r\n\r\n<p><strong>Do we have any tape measures or other promotional items?</strong><br />\r\nUnfortunately we do not; we ran out of promotional items (branded tote bags, fans, mints, tape measures, etc.) a few months ago and there are no immediate plans to replenish stock.<br />\r\n<a href=\"#Top\">Back to top</a></p>\r\n\r\n<p><a id=\"09\" name=\"09\"></a></p>\r\n\r\n<p><strong>Will Kathy make a store appearance?</strong><br />\r\nTypically Kathy does not make store appearances, but there have been some exceptions. If you would like to ask her to come to a store, please call Christine to discuss the details so she can call Kathy Ireland Worldwide and make a formal request.<br />\r\n<a href=\"#Top\">Back to top</a></p>\r\n\r\n<p><a id=\"10\" name=\"10\"></a></p>\r\n\r\n<p><strong>I would like Kathy to call one of my customers, how can I make this happen?</strong><br />\r\nPlease fill out a Sales and Media Support Request and email it to Christine. The template/blank form can be found on the Commonly Used Forms and the Brand Information sections.<br />\r\n<a href=\"#Top\">Back to top</a></p>\r\n\r\n<p><a id=\"11\" name=\"11\"></a></p>\r\n\r\n<p><strong>Who is my CSR?</strong><br />\r\nPlease check <a href=\"/sections/25\">here</a> for the most current information.<br />\r\n<a href=\"#Top\">Back to top</a></p>\r\n\r\n<p>&nbsp;</p>\r\n", :parent_id => 38, :skin_id => 4, :link => "", :active => true },
  { :name => "retailer-login", :title => "Retailer Login", :created_at => "2013-08-05 18:55:52", :updated_at => "2013-12-18 00:22:04", :content => "<p>If you have already registered, please <a href=\"http://esales.martinfurniture.com/eCustomer/logindirect.asp\" target=\"_blank\">continue to the login page.</a></p>\r\n\r\n<p>If you need to register for a new retailer access account, please fill out the form below:</p>\r\n", :parent_id => 37, :skin_id => 8, :link => "", :active => true },
  { :name => "webmail", :title => "Webmail", :created_at => "2013-09-07 00:26:58", :updated_at => "2014-01-06 23:39:47", :content => "", :parent_id => 37, :skin_id => 6, :link => "http://mail.martinfurniture.com/exchange", :active => true },
  { :name => "our-mission", :title => "Our Mission", :created_at => "2013-09-11 23:07:38", :updated_at => "2013-09-11 23:07:38", :content => "<p>Martin Home Furnishings is a furniture manufacturer, creator of products that are outstanding in style, quality and service. We strive to provide the highest levels of customer satisfaction through designs, functionality, materials and the added value that our products explicitly convey when becoming part of their home or office.</p>\r\n\r\n<p>In our pursuit to maintain and further our reputation as a manufacturer that is dedicated to recognize customer needs, we are committed to using superior materials, experienced craftsmanship, innovative designs and be obsessive about the high quality of our products and service. Our objective is to continue to be a leader in the industry we represent.</p>\r\n\r\n<p>We work as a team. Constantly nourishing open and honest communication, equal and fair treatment in an atmosphere that encourages professionalism, creativity, ownership, participation and pride in our work. Our excellence comes from people, our most valuable asset. We foster ambition, honesty, growth and independent thought through a caring, honorable, ethical and straightforward leadership that rewards people&#39;s efforts with praise and promotion.</p>\r\n\r\n<p>We are mindful of how our operations may have an impact on our community and environment. We make every effort to be good citizens by being sensitive to environmental needs, a respected employer in the community and giving back through programs involving charitable organizations or special events.</p>\r\n\r\n<p>Our goal is to manufacture the best-valued product in the marketplace, in a good, safe, caring and rewarding workplace. To maintain and grow our segment in the marketplace which will provide Martin Home Furnishings with the financial integrity and profit to our shareholders in return for their investment.</p>\r\n", :parent_id => 18, :skin_id => 4, :link => "", :active => true },
  { :name => "our-ceo", :title => "Our CEO", :created_at => "2013-09-11 23:09:23", :updated_at => "2013-09-11 23:48:09", :content => "<p><img alt=\"\" src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1378942079/gil_ed3hxw.jpg\" style=\"float:left; height:200px; margin-bottom:10px; margin-right:20px; width:150px\" /></p>\r\n\r\n<p>Gil was born in Canada, as the second of two boys. Since his parents were US citizens, he had dual citizenship until the age of eighteen, when he became a naturalized US citizen. For his first ten years he lived in Canada and the East Coast. At the age of ten, his parents moved to San Diego to be near his ailing Grandparents.</p>\r\n\r\n<p>Gil moved out on his own at the age of seventeen. His goal was to become a College level Art Instructor. Working to support himself, he put himself through Grossmont College and then into San Diego State University. He married at the age of 24 and has three children, one son and two lovely daughters. While working at General Dynamics, helping produce cruise missiles and DC10 fuselages, he started Martin Furniture as a hobby. The rest of the Martin story is history. When asked what his greatest accomplishment has been, Gil quickly answers &quot;My three children! They&#39;ve all turned out to be wonderful people.&quot;</p>\r\n", :parent_id => 18, :skin_id => 4, :link => "", :active => true },
  { :name => "executive-team", :title => "Executive Team", :created_at => "2013-09-11 23:14:55", :updated_at => "2013-09-11 23:44:51", :content => "<p><strong><img alt=\"\" src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1378942079/gil_ed3hxw.jpg\" style=\"float:left; height:200px; margin-bottom:20px; margin-right:20px; width:150px\" />Gil Martin</strong><br />\r\n<em>Founder, Chief Executive Officer</em></p>\r\n\r\n<p>Gil Martin is the founder and Chief Executive Officer of Martin Home Furnishings, and as such he focuses on the global vision of the company and coordinates strategic decisions. Before starting Martin Furniture in 1981, Martin worked for General Dynamics in the aerospace industry. At eighteen years old he designed and built his first entertainment cabinet using a sheet of oak plywood, a hand saw, a hammer, and a handful of nails. He is married with three children.</p>\r\n\r\n<div style=\"clear: both;\">&nbsp;</div>\r\n\r\n<p><strong><img alt=\"\" src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1378942079/mark_a0htvy.jpg\" style=\"float:left; height:200px; margin-bottom:20px; margin-right:20px; width:150px\" />Mark Mitchell</strong><br />\r\n<em>Executive Vice President</em></p>\r\n\r\n<p>As Executive Vice President, Mark Mitchell overseas finance and personnel operations of Martin Home Furnishings&rsquo; San Diego warehouse and the manufacturing facility in Mexico. Mitchell joined the Martin team in 1992 as Chief Financial Officer to manage growth, reporting operations and finances. Eventually he branched out into working on production efficiency and materials operations. He earned a Bachelor of Science degree in Accounting from San Diego State University. Mitchell is married with three children and has one grandchild.</p>\r\n\r\n<div style=\"clear: both;\">&nbsp;</div>\r\n\r\n<p><strong><img alt=\"\" src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1378942079/kathy_uhmlel.jpg\" style=\"float:left; height:200px; margin-bottom:20px; margin-right:20px; width:150px\" />Kathy Ireland</strong><br />\r\n<em>Chief Designer and Chief Executive Officer of Kathy Ireland Worldwide</em></p>\r\n\r\n<p>Kathy is especially proud of her partnership with this extraordinary company. Products from this partnership include furniture for offices, home offices, home theatre and wall systems. Forbes Magazine reports that Kathy leads a &ldquo;design empire which grosses over one billion dollars annually in retail sales.&rdquo; This year, Newsweek reported &ldquo;annual sales run to 1.4 billion.&rdquo; In her role of Chief Designer, Kathy collaborates with Kathy Ireland Home by Martin and Kathy Ireland Office by Martin on the design and marketing of each and every collection. Kathy is married and a busy mom with three children.</p>\r\n\r\n<div style=\"clear: both;\">&nbsp;</div>\r\n\r\n<p><strong><img alt=\"\" src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1378942079/pat_ig5ems.jpg\" style=\"float:left; height:200px; margin-bottom: 20px; margin-right:20px; width:150px\" />Pat Hayes</strong><br />\r\n<em>Vice President of Imports</em></p>\r\n\r\n<p>As Vice President of Imports, Pat Hayes oversees the production and development of all Kathy Ireland Home by Martin products, which includes designing product with Kathy Ireland and later fulfilling those designs with factories in China and Martin&rsquo;s wholly owned manufacturing facility in Mexico. Before he was promoted to Vice President of Imports, Hayes served as a general manager and assisted the customer service and marketing departments. Thus far he has spent 15 years with the company, but his experience in the industry totals 31 years.</p>\r\n\r\n<div style=\"clear: both;\">&nbsp;</div>\r\n\r\n<p><strong><img alt=\"\" src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/v1378942079/jason_fafedu.jpg\" style=\"float:left; height:200px; margin-right:20px; width:150px\" />Jason Suarez</strong><br />\r\n<em>Vice President of Operations</em></p>\r\n\r\n<p>As Vice President of Operations, Jason Suarez manages daily operations of Martin Home Furnishings&rsquo; San Diego warehouse as well as the manufacturing facility in Mexico. Suarez maximizes efficiency in company operations including production in Mexico and logistics in the United States facility. He joined the Martin team just eight years ago as an engineer and quickly moved into managing various departments including purchasing, shipping and production before becoming plant manager and eventually Vice President of Operations. He is the youngest vice president in Martin Home Furnishings history. He is married with two small children.</p>\r\n", :parent_id => 18, :skin_id => 4, :link => "", :active => true },
  { :name => "martin-home-furnishings-introduces-customer-satisfaction-department", :title => "Martin Home Furnishings introduces Customer Satisfaction Department", :created_at => "2013-10-21 23:29:16", :updated_at => "2013-10-21 23:31:38", :content => "\r\n<p><em>San Diego, California &ndash; September 06, 2011</em> &ndash; Case good manufacturer Martin Home Furnishings (Martin) has announced that it has renamed its Customer Service Department the &quot;Customer Satisfaction Department&quot;. This change was inspired by Martin&#39;s Credit/Customer Satisfaction Manger Debbie L. Jenkins.</p>\r\n\r\n<p>&quot;We don&#39;t just provide service, we are committed to providing the highest level of customer satisfaction and we want our name to reflect this,&quot; Jenkins explained. Stocking over 40,000 replacement parts, constantly monitoring inventory, achieving a quick turnaround time and a maintaining a commitment to responsive customer satisfaction helps to make the company an industry leader.</p>\r\n\r\n<p>&quot;Martin does a great job at maintaining stock levels. We are able to receive stock whenever we need it,&quot; said Julia Beyer, Case Good Analyst at Slumberland.</p>\r\n\r\n<p>Karen Pelletier, Senior Assistant Buyer at Boston Interiors added, &quot;The level of service I receive here at Boston Interiors is very good. Eric always provides a high level of service every time I contact him with questions. If he does not have the answer, he follows through in a very timely and efficient manner. He is excellent to work with.&quot;</p>\r\n\r\n<p>Each member of Martin&#39;s Customer Satisfaction Team is an expert of a specific territory. When customers call, they will not only speak with a live person, they will speak with a trained customer satisfaction representative that is knowledgeable of their territory.</p>\r\n\r\n<p>Customer Satisfaction strives to respond to a customer inquiry within two hours and can be reached by phone, fax or email. Contact information is available on the Martin Home Furnishings website as well as on all hangtags that come with Martin products.</p>\r\n\r\n<h2 class=\"sub-header\">About Martin Home Furnishings</h2>\r\n\r\n<p>In 1981 Gil Martin founded Martin Furniture, a premier producer of home office and home entertainment furniture. In April 2003, Martin Furniture partnered with kathy ireland Worldwide and became kathy ireland Home&trade; by Martin (kiHbM), the sole licensed manufacturer of home office and home entertainment furniture under the kathy ireland™ Home brand. Martin products are sold through several retail channels all over the country including warehouse clubs, commercial office, catalogs, Top 100 Retailers, and specialty stores.</p>", :parent_id => 20, :skin_id => 4, :link => "", :active => true },
  { :name => "martin-product-awarded-best-buy-in-consumers-digest", :title => "Martin Product Awarded Best Buy in Consumers Digest", :created_at => "2013-10-21 23:34:28", :updated_at => "2013-10-21 23:34:28", :content => "<p>\r\n\t\t\t\t\t<i>San Diego, California – June 22, 2010</i> – Martin Home Furnishings' Southampton desk and hutch has earned the prestigious Best Buy seal from Consumers \r\n\t\t\t\t\tDigest Magazine in the Closed Units &amp; Workstations category.  Selected based on quality of construction, features and style, a Consumers Digest Best \r\n\t\t\t\t\tBuy is defined as a product that offers the most value for a given price. \"It is truly satisfying to be recognized in a national publication for designs \r\n\t\t\t\t\tthat include function and style,\" said CEO Gil Martin.   \"We constantly try to find ways to make our products more usable in the consumer's home. Today's \r\n\t\t\t\t\telectronics are requiring changes in furniture at a pace not seen before. It sounds like we are on the right track.\"      \r\n\t\t\t\t</p>\r\n\t\t\t\t\r\n\t\t\t\t<p>\r\n\t\t\t\t\tThe Kathy Ireland Home by Martin Southampton desk and hutch was named a premium category best buy.  The Consumers Digest editors liked the combination of \r\n\t\t\t\t\tbuilt-in computer hookups on the desktop, the surge protector and the size drawers that provides generous storage space. \"We especially like the contrasting\r\n\t\t\t\t\thardwood desk-tops. The 10-year warranty is the longest of any workstation that we found.\"  The Southampton desk and hutch are available in Onyx (black) \r\n\t\t\t\t\twith an oak desktop or in Oyster (white) with a maple desktop.  This article will appear in the August issue of Consumers Digest Magazine.                \r\n\t\t\t\t</p>\r\n\t\t\t\t\r\n\t\t\t<h2 class=\"sub-header\">About Martin Home Furnishings</h2>\r\n\t\t\t\t\r\n\t\t\t\t<p>\r\n\t\t\t\t\tIn 1981 Gil Martin founded Martin Furniture, a premier producer of home office and home entertainment furniture. In April 2003 Martin Furniture partnered \r\n\t\t\t\t\twith Kathy Ireland Worldwide and became Kathy Ireland Home by Martin (KIHBM), the sole licensed manufacturer of home office and home entertainment furniture \r\n\t\t\t\t\tunder the Kathy Ireland Home brand. In late 2008, Martin Furniture acquired Highland Design to create the brand Curt Christian Design by Martin which produces \r\n\t\t\t\t\tbedroom and dining furniture, and changed its name to Martin Home Furnishings.  Martin products are sold through several retail channels all over the country \r\n\t\t\t\t\tincluding warehouse clubs, commercial office, catalogs, Top 100 Retailers, and specialty stores.\r\n\t\t\t\t</p>", :parent_id => 20, :skin_id => 4, :link => "", :active => true },
  { :name => "martin-tops-40-000-spare-parts-to-satisfy-the-quick-turnaround-that-customers-find-essential", :title => "Martin Tops 40,000 Spare Parts to Satisfy the Quick Turnaround that Customers Find Essential", :created_at => "2013-10-21 23:36:09", :updated_at => "2013-10-21 23:37:36", :content => "<p><em>San Diego, California &ndash; June 10, 2010</em> &ndash; In the fiercely competitive furniture industry top notch personal service and a strong parts department are key ingredients to maintaining competitive edge. At Martin Home Furnishings (Martin) the parts department works diligently to keep customers satisfied. Stocking over 40,000 replacement parts, constantly monitoring inventory, achieving a quick turnaround time and a maintaining a commitment to responsive customer service helps to make the company an industry leader.</p>\r\n\r\n<p>Replacement parts for both domestic and imported products are stocked in Martin&rsquo;s San Diego warehouse as well as in its wholly owned Mexico factory. The San Diego warehouse stocks over 5,000 bar coded bins of new replacement parts. An advanced computerized coding system allows parts to be located and shipped quickly and for inventory to be monitored. Orange safety nets keep the parts in place in the event of an earthquake or other natural disaster consistent with our commitment to safely in the workplace.</p>\r\n\r\n<p>Martin&rsquo;s Mexico factory is able to manufacture parts on site and ship directly to the customer. Martin even stocks parts for discontinued items up to ten years. Parts are sent out to customers five days a week, with a turnaround time of 7-15 days. If the product is under warranty, customers can ship the products to Martin for repair or replacement and the item is shipped back to the customer without charge.</p>\r\n\r\n<p>Customer service will respond to a customer inquiry within two hours and can be reached by phone, fax or email. Contact information is available on the Martin Home Furnishings website as well as on all hangtags that come with Martin products.</p>\r\n\r\n<h2 class=\"sub-header\">About Martin Home Furnishings</h2>\r\n\r\n<p>In 1981 Gil Martin founded Martin Furniture, a premier producer of home office and home entertainment furniture. In April 2003 Martin Furniture partnered with Kathy Ireland Worldwide and became Kathy Ireland Home by Martin (KIHBM), the sole licensed manufacturer of home office and home entertainment furniture under the Kathy Ireland Home brand. In late 2008, Martin Furniture acquired Highland Design to create the brand Curt Christian Design by Martin which produces bedroom and dining furniture, and changed its name to Martin Home Furnishings. Martin products are sold through several retail channels all over the country including warehouse clubs, commercial office, catalogs, Top 100 Retailers, and specialty stores.</p>\r\n", :parent_id => 20, :skin_id => 4, :link => "", :active => true },
  { :name => "kiww-and-kathy-ireland-home-by-martin-renew-agreement-expand-their-partnership", :title => "KIWW™ and kathy ireland™ Home by Martin Renew Agreement & Expand their Partnership", :created_at => "2013-10-21 23:40:10", :updated_at => "2013-10-21 23:40:10", :content => "<p>\r\n\t\t\t\t\t<i>San Diego, California – January 14, 2011</i> – kathy ireland&#8482; Home by Martin (kiHbM), a leading manufacturer and \r\n                    wholesaler of fine home office and entertainment furniture, announced that by mutual agreement their partnership with \r\n                    kathy ireland&#8482; Worldwide&reg; (kiWW&reg;) has been extended through 2015.  2011 will be a year for renewing and expanding the kathy \r\n                    ireland&#8482; Home by Martin collection.\r\n\t\t\t\t</p>\r\n\t\t\t\t\r\n\t\t\t\t<p>\r\n\t\t\t\t\tKathy Ireland, CEO and Chief Designer for kiWW&reg; will provide Martin with fresh ideas for new designs for 2011 with the mission \r\n                    of \"…finding solutions for families, especially busy Moms.\" &#8482;                  \r\n\t\t\t\t</p>\r\n                \r\n                <p>\r\n                \t\"Gil Martin is an extraordinary leader who has brought kathy ireland&#8482; Home by Martin to new heights,\" said Kathy Ireland,\r\n                    Chief Designer and CEO of kiWW&reg;. \"His company's ability to translate our designs into exquisite home office and home entertainment \r\n                    furniture has changed the landscape of excellence in the category.  Our kathy ireland&#8482; Home by Martin products are the couture \r\n                    of home office and home entertainment furniture.  Gil and his team are extraordinary and we are proud and delighted that our agreement \r\n                    with this company will continue through 2015 and hopefully far beyond,\" said Ireland. \r\n                </p>\r\n\t\t\t\t<p>\r\n                \t\"Kathy and her design team have been responsible for developing some of our most successful collections ever,\" said Gil Martin, CEO of \r\n                    kathy ireland&#8482; Home by Martin.   \"Kathy is hands-on in every area from concept to construction to showroom and actual customer sales. \r\n                    Kathy's very loyal customer tells her what she needs and at what price point. We need to listen and build on that.  Being in close contact \r\n                    with retailers, Kathy understands the needs of marketplace.  She advises us on style, design and price. Our partnership with kathy ireland&#8482; \r\n                    Worldwide&reg; has been, and continues to be, a beneficial and wonderful experience for me personally and for our company. We have grown over the \r\n                    past few years with the partnership being an important contributing factor.  We are looking forward to creating more kathy ireland&#8482; collections \r\n                    than ever before.\"\r\n                </p>\r\n                <p>\r\n                \tIn 1981 Gil Martin founded Martin Furniture, a premier producer of home office and home entertainment furniture. In April 2003 Martin \r\n                    Furniture partnered with kathy ireland&#8482; Worldwide&reg; and became kathy ireland&#8482; Home by Martin (kiHbM), the sole licensed \r\n                    manufacturer of home office and home entertainment furniture under the kathy ireland&#8482; Home brand.  In 2007, kiHbM and kiWW&reg; \r\n                    signed an agreement giving the parties mutual rights to extend their partnership which has now been completed.\r\n                </p>\r\n                <p>\r\n                \tIn August 2010, kiWW&reg; partnered with Bush Furniture, a ready-to-assemble home office and entertainment furniture specialist.  The \r\n                    initial products will be kathy ireland&#8482; Office by Bush.  \"I have always viewed Bush Furniture as one of the most respected manufacturers \r\n                    in the ready-to-assemble category,\" Martin said.  While designs from both manufacturers promise Fashion, Value, Quality and Safety&#8482;, \r\n                    kathy ireland&#8482; Home by Martin offers fully assembled, better to best price point products while kathy ireland&#8482; Office by Bush offers \r\n                    ready-to-assemble designs at entry level pricing. \r\n                </p>\r\n                \r\n\t\t\t<h2 class=\"sub-header\">About Martin Home Furnishings</h3>\r\n\t\t\t\t\r\n\t\t\t\t<p>\r\n\t\t\t\t\tIn 1981 Gil Martin founded Martin Furniture, a premier producer of home office and home entertainment furniture. In April 2003 Martin Furniture \r\n                    partnered with kathy ireland&#8482; Worldwide and became kathy ireland&#8482; Home by Martin (kiHbM), the sole licensed manufacturer of home office \r\n                    and home entertainment furniture under the kathy ireland&#8482; Home brand. In late 2008, Martin Furniture acquired Highland Design to create the \r\n                    brand Curt Christian Design by Martin which produces bedroom furniture, and changed its name to Martin Home Furnishings. Martin products are sold \r\n                    through several retail channels all over the country including warehouse clubs, commercial office, catalogs, Top 100 Retailers, and specialty stores.  \r\n                    </p>\r\n                \r\n             <h2 class=\"sub-header\">About kathy ireland&#8482; Worldwide&reg;</h2>\r\n             \t<p>\r\n                \tkathy ireland&#8482; Worldwide&reg; (kiWW&reg;) is the design and marketing firm founded in 1993 by CEO and Chief Designer, Kathy Ireland.\r\n                </p>\r\n                \r\n                <p>\r\n                     The mission statement of kiWW&reg; is \"…finding solutions for families, especially busy moms.\"&#8482; kiWW&reg; turns to design experts in many areas, \r\n                     kiWW&reg; Brand Solutions include ACafe Society by Chef Andre which addresses cooking and entertaining and Jardin J du J by Nicholas Walker, which \r\n                     celebrates the gardens of the world and brings the outdoors in. Forbes.com names Kathy Ireland one of the 20 Best-Branded Women on Twitter.  Forbes \r\n                     Magazine reports that kathy ireland&#8482; Worldwide&reg; (kiWW&reg;) is a \"design empire which grosses over 1.4 billion dollars annually in retail \r\n                     sales.\" 2010 License Global Magazine names kathy ireland&#8482; Worldwide&reg; #28 most powerfully licensed brand globally.\r\n                </p>\r\n                <p>\r\n                    kathy ireland&#8482; Worldwide&reg; products include furniture, flooring, decorative surfaces, lighting and accessories, window treatments, replacement \r\n                    windows, home office and entertainment, leather and microfiber, infant, youth and adult top of bed, bedding, candles, hand-painted fine porcelain, \r\n                    decorative shelving, apparel, fresh-cut flowers, skin-care for men and women, wall coverings, ceiling fans, mattresses, totes, hand bags, travel bags, \r\n                    frames, wall décor, clocks, Design It Yourself jewelry and crafting supplies, kitchen and bath cabinetry, infant furniture, Ready to Assemble (RTA), \r\n                    decorative shelving, fine jewelry, wigs and hair extensions, real estate, vacation events, wedding program licenses, music and film licenses, publishing, \r\n                    greeting cards, Kathy is the author of six books: Powerful Inspirations: Eight Lessons that Will Change Your Life, Real Solutions for Busy Moms: Your Guide \r\n                    To Success and Sanity, Real Solutions for Busy Moms Devotional: 52-God Inspired Messages for Your Heart and children's books: What Do Mommies Do?, An \r\n                    Angel Called Hope and Mona's Favorite Words.\r\n\t\t\t\t</p>\r\n                <p>\r\n                \tkiWW&reg; maintains offices and design studios in Los Angeles, Rancho Mirage, and Santa Barbara, CA, Hawaii and Israel. Additional information is \r\n                    available at <a href=\"http://www.kathyireland.com\" target=\"_blank\">kathyireland.com</a>.\r\n                </p>", :parent_id => 20, :skin_id => 4, :link => "", :active => true },
  { :name => "kathy-ireland-to-attend-martin-s-ribbon-cutting-ceremony-for-new-high-point-showroom", :title => "Kathy Ireland to attend Martin's Ribbon Cutting Ceremony for New High Point Showroom", :created_at => "2013-10-21 23:43:07", :updated_at => "2013-10-21 23:44:08", :content => "<p><em>San Diego, Calif. - April 9, 2010</em> - Martin Home Furnishings (Martin) will unveil its newly expanded showroom during a ribbon cutting ceremony on Saturday, April 17 at 2:00pm. The newly expanded showroom will be used to present products under both the Kathy Ireland Home by Martin and Curt Christian by Martin brands.</p>\r\n\r\n<p>The ribbon cutting will take place at the entrance of Furniture Plaza space 512, and will be attended by Kathy Ireland, chief designer of kathy ireland Home by Martin, and Curt Christian with Martin Home Furnishings. The grand opening event will welcome buyers into the newly expanded 17,000+ square foot showroom which had a complete floor-to-ceiling renovation. With an entrance directly in front of the escalators on the fifth floor of Furniture Plaza, Martin&#39;s showroom is easy to find and access.</p>\r\n\r\n<p>As High Point becomes Martin Home Furnishings&#39; primary showroom venue, the company is proud to showcase their expanding brands and categories in a larger space. &quot;As we expand our kathy ireland Home by Martin brand and round out our master bedroom collections under Curt Christian, we want a presentation that complements the quality level of our products,&quot; says Karl Eulberg, Martin&#39;s vice president of sales and marketing. &quot;Fortunately, our sales growth has allowed us step up our market presentation. Our customers will find it easier to shop and buy.&quot;</p>\r\n\r\n<p>Gil Martin, CEO of Martin, wanted his new showroom to incorporate a respite for customers. &quot;We will have a dining area with windows, a great view, and an inviting, informal area to relax at the end of a shopping day and enjoy a glass of wine, review notes or just wind down,&quot; says Martin. An espresso bar will be open daily at 8am, lunch will be served daily and a hand selected wine list will be available for customers to enjoy at the end of the day. Martin&#39;s showroom will be open at 8am April 17-22.</p>\r\n\r\n<h2 class=\"sub-header\">About Martin Home Furnishings</h2>\r\n\r\n<p>In 1981 Gil Martin founded Martin Furniture, a premier producer of home office and home entertainment furniture. In April 2003 Martin Furniture partnered with Kathy Ireland Worldwide and became Kathy Ireland Home by Martin (KIHBM), the sole licensed manufacturer of home office and home entertainment furniture under the Kathy Ireland Home brand. In late 2008, Martin Furniture acquired Highland Design to create the brand Curt Christian Design by Martin which produces bedroom and dining furniture, and changed its name to Martin Home Furnishings. Martin products are sold through several retail channels all over the country including warehouse clubs, commercial office, catalogs, Top 100 Retailers, and specialty stores.</p>\r\n", :parent_id => 20, :skin_id => 4, :link => "", :active => true },
  { :name => "martin-home-furnishings-announces-major-expansion-of-high-point-presence", :title => "Martin Home Furnishings Announces Major Expansion of High Point Presence", :created_at => "2013-10-21 23:45:40", :updated_at => "2013-10-21 23:45:40", :content => "<p>\r\n\t\t\t\t\t<i>San Diego, Calif. - March 08, 2010</i> - Currently showing on the 5th floor of Furniture Plaza, Martin Home Furnishing (Martin) \r\n\t\t\t\t\thas announced it will more than doubled the size of their High Point showroom.  Several showrooms were combined and a complete \r\n\t\t\t\t\tfloor-to-ceiling renovation has now been completed.  As High Point becomes a more important and permanent venue for Martin Home \r\n\t\t\t\t\tFurnishings, the company wants to showcase their expanding brands and categories in a larger space.   With an entrance directly \r\n\t\t\t\t\tin front of the escalators, Martin's new home should be easy to find and shop, even in inclement weather.  \r\n\t\t\t\t</p>\r\n\t\t\t\t\r\n\t\t\t\t<p>\r\n\t\t\t\t\tAs a proud brand partner of Kathy Ireland Home, Martin will highlight this growing brand and present products that will showcase \r\n\t\t\t\t\tKathy's influence on design.  \"Kathy Ireland Home remains very important to us,\" says Martin's president Gil Martin. \"We are \r\n\t\t\t\t\tthrilled to finally have a complete showcase for her designs in High Point\". \r\n\t\t\t\t</p>\r\n\t\t\t\t\r\n\t\t\t\t<p>\r\n\t\t\t\t\tAs Curt Christian, Martin's VP of Design, widens his selection of bedroom suites and commits to a major expansion of the Timeless \r\n\t\t\t\t\tTransitional segment, Curt felt \"It's essential that we have enough space to express our direction and provide great ideas to our \r\n\t\t\t\t\tretailers on how they might showcase our designs.\"  \r\n\t\t\t\t</p>\r\n\t\t\t\t\r\n\t\t\t\t<p>\r\n\t\t\t\t\tFinally, Mr. Martin wanted his new showroom to incorporate a respite for customers.  \"We will have a dining area with windows, a great view, \r\n\t\t\t\t\tand an inviting, informal area to relax at the end of a shopping day and enjoy a glass of wine, review notes or just wind down\" says Mr. Martin.  \r\n\t\t\t\t\tLunch will be served daily and a hand selected wine list will be available for customers to enjoy at the end of the day.\r\n\t\t\t\t</p>\r\n\t\t\t\t\r\n\t\t\t<h2 class=\"sub-header\">About Martin Home Furnishings</h2>\r\n\t\t\t\t\r\n\t\t\t\t<p>\r\n\t\t\t\t\tIn 1981 Gil Martin founded Martin Furniture, a premier producer of home office and home entertainment furniture. In April 2003 \r\n\t\t\t\t\tMartin Furniture partnered with Kathy Ireland Worldwide and became \"Kathy Ireland Home by Martin\" (KIHBM), the sole licensed\r\n\t\t\t\t\tmanufacturer of home office and home entertainment furniture under the Kathy Ireland Home brand. In late 2008, Martin Furniture \r\n\t\t\t\t\tacquired the \"Curt Christian Design\" Brand, (which produces bedroom and dining furniture) adding it as the second \"Martin Home \r\n\t\t\t\t\tFurnishings\" brand.    Both brands are sold at several retail channels all over the country including Top 100 Retailers, warehouse clubs, commercial office, catalogs, \r\n\t\t\t\t\tand specialty stores.</p>", :parent_id => 20, :skin_id => 4, :link => "", :active => true }
], :without_protection => true )



