  { :name => "americana", :title => "Americana", :created_at => "2013-08-05 05:47:49", :updated_at => "2013-11-04 17:47:38", :description => "<p><img alt=\"\" src=\"http://res.cloudinary.com/hmnxgsjti/image/upload/c_limit,h_800,w_800/v1383587218/ik02wy4nea60lrnbocvh.jpg\" style=\"float:left; height:70px; margin:15px; width:70px\" />Elegant, yet relaxed and steeped in the very best of our country&rsquo;s heritage, the Americana Style Guide&trade; offers rustic simplicity at its finest.&nbsp; Americana seeks to embody the diversity and rich traditions of our nation through the use of subtle distressing and inspiration from colors such as Yellow Corn, Green Grass and Wheatfield Brown.&nbsp; Unique and intricate detailing, the use of an eclectic array of materials and incredible durability are the cornerstones of this traditional style.</p>\r\n", :link => "" },
